INSERT INTO `chitietnangluc` VALUES (518,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Biết được \"Trung Thực\" là một trong năm giá trị cốt lõi của LIXCO, là văn hóa doanh nghiệp mà mọi người LIX đều cam kết thực hiện.',106),(519,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Hiểu đúng nội dung giá trị cốt lõi \"Trung Thực\" nhưng chưa thể hiện rõ ràng và đầy đủ qua hành vi. ',106),(520,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Thể hiện rõ ràng qua tất cả những hành động sau:\n- Thống nhất giữa lời nói và hành động. \n- Chủ động nhận lỗi, sai trái khi mình mắc phải.\n- Nhận định sự việc dựa trên phân tích nhiều khía cạnh khác nhau.',106),(521,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Thể hiện rõ ràng qua tất cả những hành động sau:\n-  Có hành động bảo vệ chân lý, lẽ phải đến cùng. \n- Vạch trần các sự việc sai sái, không đúng quy định.\n- Giải quyết các vấn đề sai trái dựa trên các quy định rõ ràng.\n- Không chịu sự chi phối từ đối tượng khác dưới áp lực về vị trí hoặc quyền lợi cá nhân.',106),(522,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Đưa ra hệ thống giá trị cốt lõi và văn hóa doanh nghiệp cho người khác thực hiện theo.',106),(523,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Biết được \"Trung Thành\" là một trong năm giá trị cốt lõi của LIXCO, là văn hóa doanh nghiệp mà mọi người LIX đều cam kết thực hiện.',107),(524,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Hiểu đúng nội dung giá trị cốt lõi \"Trung Thành\" nhưng chưa thể hiện rõ ràng và đầy đủ qua hành vi. ',107),(525,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Thể hiện rõ ràng qua tất cả những hành động sau:\n- Chủ động tham gia các chương trình nhằm đạt được mục tiêu của phòng ban/ tổ chức \n- Đưa ra các điều kiện giữa quyền lợi và trách nhiệm khi tham gia các nhiệm vụ mới \n- Chủ động tham gia các chương trình xây dựng mục tiêu chung của phòng ban/ tổ chức \n- Tìm hiểu đến quá trình phát triển nghề nghiệp tại Công ty \n- Tham gia đề xuất giải pháp phát triển phòng ban/ tổ chức khi có yêu cầu',107),(526,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Thể hiện rõ ràng qua tất cả những hành động sau:\n- Luôn đặt lợi ích tập thể lên trên lợi ích cá nhân \n- Tích cực tham gia các chương trình xây dựng mục tiêu chung của phòng ban/ tổ chức \n- Lên kế hoạch phát triển năng lực phù hợp với yêu cầu của Công ty \n- Chủ động đề xuất giải pháp góp phần phát triển phòng ban/tổ chức',107),(527,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Đưa ra hệ thống giá trị cốt lõi và văn hóa doanh nghiệp cho người khác thực hiện theo.',107),(528,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Biết được \"Tin Tưởng\" là một trong năm giá trị cốt lõi của LIXCO, là văn hóa doanh nghiệp mà mọi người LIX đều cam kết thực hiện.',108),(529,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Hiểu đúng nội dung giá trị cốt lõi \"Tin Tưởng\" nhưng chưa thể hiện rõ ràng và đầy đủ qua hành vi. ',108),(530,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Thể hiện rõ ràng qua tất cả những hành động sau:\n-  Thể hiện niềm tin và đồng lòng đối với các chính sách, chiến lược phát triển của công ty ;   \n- Luôn là người gương mẫu trong lời nói và hành động\n- Biết cách xây dựng niềm tin đối với khách hàng/ đối tác/ đồng nghiệp ',108),(531,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Thể hiện rõ ràng qua tất cả những hành động sau:\n- Hành động, lời nói thể hiện sự tin tưởng tuyệt đối vào chiến lược phát triển của công ty và cộng sự \n- Là đối tác tin cậy của khách hàng khi đại diện cho Công ty trong quá trình hợp tác, kinh doanh \n- Là người suy nghĩ tích cực, đưa ra những ý kiến đáng tin cậy trong quá trình phát triển công ty \n- Là người được khách hàng/ đối tác/ đồng nghiệp tin cậy trong quá trình tư vấn giải quyết công việc',108),(532,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Đưa ra hệ thống giá trị cốt lõi và văn hóa doanh nghiệp cho người khác thực hiện theo.',108),(533,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Biết được \"Tôn Trọng\" là một trong năm giá trị cốt lõi của LIXCO, là văn hóa doanh nghiệp mà mọi người LIX đều cam kết thực hiện.',109),(534,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Hiểu đúng nội dung giá trị cốt lõi \"Tôn Trọng\" nhưng chưa thể hiện rõ ràng và đầy đủ qua hành vi. ',109),(535,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Thể hiện rõ ràng qua tất cả những hành động sau:\n- Thể hiện sự tôn trọng mọi người để nhận được sự tôn trọng của người khác\n- Có thái độ bình tĩnh, cởi mở với nhiều ý kiến khác nhau\n- Biết cách công nhận người khác\n - Biết tranh luận và thương lượng để tìm phương án dung hòa',109),(536,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Thể hiện rõ ràng qua tất cả những hành động sau:\n- Luôn là người khởi xướng và chủ động chia sẻ \n- Luôn tận dụng và nắm bắt mọi cơ hội để lắng nghe chia sẻ từ người khác\n- Lắng nghe tích cực bằng cách nghe nghiêm túc và đặt câu hỏi xác nhận\n- Lắng nghe có chọn lọc và ứng dụng vào công việc, hành vi, thái độ ',109),(537,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Đưa ra hệ thống giá trị cốt lõi và văn hóa doanh nghiệp cho người khác thực hiện theo.',109),(538,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Biết được \"Tận Tâm\" là một trong năm giá trị cốt lõi của LIXCO, là văn hóa doanh nghiệp mà mọi người LIX đều cam kết thực hiện.',110),(539,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Hiểu đúng nội dung giá trị cốt lõi \"Tận Tâm\" nhưng chưa thể hiện rõ ràng và đầy đủ qua hành vi. ',110),(540,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Thể hiện rõ ràng qua tất cả những hành động sau:\n-  Mức độ tận tâm được đa số đồng nghiệp nhìn nhận.\n-  Luôn làm việc nhiệt tình, xem việc của khách hàng, đồng nghiệp như của mình.\n-  Dám nhận triển khai những công việc mang tính tinh thần trách nhiệm cao.',110),(541,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Thể hiện rõ ràng qua tất cả những hành động sau:\n-  Luôn giữ tâm sáng, hết lòng vì công việc, vì khách hàng và đồng nghiệp .\n-  Làm việc tận tuỵ, tinh thần làm việc tận tuỵ, hơn cả sự mong đợi.\n-  Luôn thể hiện trách nhiệm cao nhất trong bất kỳ hoàn cảnh nào.',110),(542,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Đưa ra hệ thống giá trị cốt lõi và văn hóa doanh nghiệp cho người khác thực hiện theo.',110),(543,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Biết được \"Công Bằng\" là một trong những quy tắc xử sự thể hiện văn hóa doanh nghiệp mà mọi người LIX đều cam kết thực hiện.',111),(544,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Hiểu đúng nội dung quy tắc \"Công bằng\" nhưng chưa thể hiện rõ ràng và đầy đủ qua hành vi. ',111),(545,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Thể hiện rõ ràng qua tất cả những hành động sau:\n- Luôn nhận xét, quyết định dựa trên những dữ kiện có sẵn, cụ thể \n- Kết quả công việc là cơ sở để thảo luận và phân tích các vấn đề  \n- Phản biện dựa trên tinh thần xây dựng, hướng đến giải pháp cụ thể ',111),(546,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Thể hiện rõ ràng qua tất cả những hành động sau:\n- Không chấp nhận sự bất công và luôn tìm cách đảm bảo sự công bằng\n- Là nơi mà cộng sự có thể tin cậy nhờ làm trọng tài phân xử cho các tranh cãi    \n- Trước mọi vấn đề đều có chủ kiến độc lập và khách quan, có lý lẽ',111),(547,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Đưa ra hệ thống giá trị cốt lõi và văn hóa doanh nghiệp cho người khác thực hiện theo.',111),(548,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Biết được \"Chia sẻ\" là một trong những quy tắc xử sự thể hiện văn hóa doanh nghiệp mà mọi người LIX đều cam kết thực hiện.',112),(549,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Hiểu đúng nội dung quy tắc \"Chia sẻ\" nhưng chưa thể hiện rõ ràng và đầy đủ qua hành vi. ',112),(550,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Thể hiện rõ ràng qua tất cả những hành động sau:\n- Đối với đồng nghiệp luôn chia sẻ, phối hợp, hỗ trợ cùng nhau thực hiện mục tiêu chung \n- Đối với đối tác, khách hàng luôn chia sẻ, hợp tác dựa trên tinh thần đôi bên cùng có lợi \n- Chủ động thực hiện, tham gia các hoạt động chia sẻ cùng cộng đồng',112),(551,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Thể hiện rõ ràng qua tất cả những hành động sau:\n- Luôn chủ động chia sẻ, hỗ trợ trong quá trình thực hiện mục tiêu chung của tổ chức \n- Chủ động chia sẻ, định hướng mối quan hệ hợp tác đôi bên cùng có lợi đối với đối tác, khách hàng \n- Là người khởi xướng các tiêu chí hợp tác dựa trên tinh thần chia sẻ, hợp tác đôi bên cùng có lợi\n- Là người khởi xướng các hành động, chương trình chia sẻ cùng cộng đồng',112),(552,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Đưa ra hệ thống giá trị cốt lõi và văn hóa doanh nghiệp cho người khác thực hiện theo.',112),(553,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Đặt ra được mục tiêu cá nhân phù hợp với chiến lược hành động của đội/nhóm và các giá trị của doanh nghiệp.',113),(554,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Điều phối được hoạt động của đội/nhóm phù hợp với chiến lược chung của doanh nghiệp.\n- Hình dung được hệ quả của vấn đề.',113),(555,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả các yêu cầu sau:\n- Xây dựng được mục tiêu và các kế hoạch hành động cho đội/nhóm dựa trên mục tiêu chung của doanh nghiệp.\n- Điều phối được hoạt động của đội/nhóm phù hợp với chiến lược chung của doanh nghiệp.\n- Đánh giá chính xác nguyên nhân, hệ quả của vấn đề đặt trong sự tương quan giữa các bộ phận trong doanh nghiệp.',113),(556,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng truyền đạt được mục tiêu, tầm nhìn, chiến lược của tổ chức tới nhiều đối tượng cá nhân.\n- Xác định được các cơ hội và nguy cơ có thể xảy đến tổ chức và có phương án hành động phù hợp với giá trị và tầm nhìn của doanh nghiệp.\n- Thường xuyên quan sát, đánh giá, tổng hợp và hành động dựa trên mối tương quan trong và ngoài doanh nghiệp.',113),(557,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Định hình được hoặc có định hướng phát triển giá trị tổ chức.\n- Phát triển xây dựng được kế hoạch hành động phù hợp với mục đích và giá trị của tổ chức.\n- Dẫn dắt tổ chức đi theo chiến lược.',113),(558,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Nhận định được xung đột giữa các cá nhân và đội nhóm\n- Cổ vũ mọi người hòa giải xung đột',114),(559,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Chủ động tiếp nhận những quan điểm khác nhau, đề xuất được phương án hòa giải xung đột trong đội nhóm\n- Cổ vũ mọi người hạn chế những xung đột cá nhân không cần thiết',114),(560,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả các yêu cầu sau:\n- Dự đoán được những xung đột có thể xảy ra, có có biện pháp để ngăn chặn, giảm thiểu hậu quả của xung đột ở quy mô phòng.',114),(561,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Dự đoán và xây dựng được chiến lược ngăn chặn và giải quyết xung đột ở quy mô tổ chức',114),(562,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng thúc đẩy những căng thẳng và tranh luận có lợi cho tổ chức; giữ mức độ căng thẳng trong tầm kiểm soát\n- Dự đoán được những xung đột có thể xảy ra ở quy mô tổ chức, có phương án định hướng, ngăn chặn và giải quyết xung đột bằng thái độ mang tính xây dựng',114),(563,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Đảm bảo rằng các thành viên có các thông tin cần thiết để hoạt động\n- Chưa chủ động quan tâm tới sự tương tác giữa các thành viên',115),(564,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Đáp ứng được các nhu cầu thiết thực của nhóm và các thành viên\n- Đảm bảo rằng các nhiệm vụ của nhóm được hoàn thành',115),(565,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả các yêu cầu sau:\n- Chỉ định công việc dựa trên cấp độ kỹ năng của thành viên nhóm và lĩnh vực quan tâm\n- Biết cách đánh giá nhân viên và đưa ra các đề xuất, phản hồi kịp thời\n- Biết cách giải quyết mâu thuẫn nội bộ trong nhóm',115),(566,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Biết cách xây định hướng phát triển cho nhân viên dựa trên năng lực, sở thích nghề nghiệp và nhu cầu công việc\n- Biết lập kế hoạch cho việc đào tạo và trau dồi kỹ năng cho các thành viên\n- Xác định được vai trò và trách nhiệm của từng thành viên trong nhóm và thiết lập mục tiêu tổng thể\n- Tạo được sự gắn kết, tích cực giúp đỡ nhau giữa các thành viên',115),(567,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Chủ động tạo ra cơ hội thăng tiến cho tất cả thành viên trong nhóm\n- Thiết lập được uy tín của nhóm với các bên liên quan khác\n- Tạo ra được môi trường hiệu quả, giúp các thành viên cải thiện hiệu suất và năng suất làm việc\n- Thiết lập được mục tiêu chiến lược dài hạn của nhóm đi đôi với mục tiêu của cả tổ chức',115),(568,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Biết lắng nghe tâm tư, nguyện vọng học tập của người được đào tạo\n- Biết cách phân chia công việc hợp lý cho người được đào tạo\n- Năng lực cá nhân còn hạn chế, chưa sẵn sàng làm người đào tạo cho người khác',116),(569,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Chủ động giới thiệu các chương trình đào tạo ngoài cho nhân viên\n- Kịp thời động viên, củng cố nỗ lực học tập của nhân viên\n- Cung cấp phản hồi cho nhân viên trong quá trình làm việc',116),(570,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả các yêu cầu sau:\n- Tạo được sự hứng thú cho người được đào tạo\n- Tạo cơ hội cho nhân viên ít kinh nghiệm được học hỏi từ các nhân viên dày dạn\n- Phản hồi kịp thời và nhất quán về quá trình học lý thuyết kết hợp thực hành của nhân viên',116),(571,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Định hướng được nội dung đào tạo dựa trên nhu cầu công việc của nhân viên\n- Giúp nhân viên tìm những cách mới để giải quyết các vấn đề cũ\n- Chủ động đánh giá các vấn đề của nhân viên và chia sẻ giải pháp để tạo ra kinh nghiệm làm việc',116),(572,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Đánh giá chính xác được năng lực đã có và năng lực cần đào tạo của từng nhân viên\n- Lập ra kế hoạch đào tạo phù hợp với chiến lược của tổ chức và định hướng phát triển của cá nhân\n- Sẵn sàng cung cấp các hướng dẫn rõ ràng, ngắn gọn về cách hoàn thành một nhiệm vụ hoặc quy trình',116),(573,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng bảo vệ ý kiến cá nhân, đưa ra đề xuất nhưng không thực sự thuyết phục\n- Còn e ngại, chưa tự tin vào bản thân',117),(574,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng thuyết phục, bảo vệ ý kiến cá nhân\n- Nhận được sự tôn trọng, lắng nghe từ mọi người',117),(575,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả các yêu cầu sau:\n- Tích cực tham dự đóng góp trong các cuộc thảo luận, các hoạt động quan trọng\n- Có khả năng đưa ra các đề xuất thuyết phục, có hiệu quả',117),(576,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Tạo được uy tín trong tổ chức và các bên liên quan\n- Luôn đóng vai trò chủ động trong các buổi gặp gỡ, thảo luận, tranh luận\n- Tự tin thể hiện quan điểm và tài năng trước đám đông',117),(577,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Luôn đóng vai trò cố vấn, người đứng đầu trong các kế hoạch quan trọng\n- Có ý chí kiên định, nhận được sự ủng hộ của đa số mọi người\n- Gương mẫu đi đầu trong cách hoạt động, phong trào của tổ chức\n- Mọi ý kiến, đề xuất cá nhân đều được đề cao',117),(578,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Chưa sẵn sàng đối mặt với rủi ro\n- Còn lúng túng trong việc giải quyết hậu quả của rủi ro (nếu có)',118),(579,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Xác định tâm lý vững vàng để sẵn sàng đối mặt và chịu trách nhiệm với rủi ro\n- Có ý thức về việc nhận định các rủi ro nhưng chưa chính xác',118),(580,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả các yêu cầu sau:\n- Nhận định được các rủi ro với quy mô nhỏ, trong tương lai gần\n- Kịp thời phân tích rủi ro để có được đánh giá cần thiết\n- Biết cách thông tin cho thành viên trong tổ chức về rủi ro có thể xảy ra',118),(581,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có tầm nhìn dài hạn về việc nhận định các rủi ro có thể xảy ra\n- Có khả năng đánh giá rủi ro và đề xuất phương án giảm thiểu hậu quả\n- Đưa ra được chiến lược phòng tránh rủi ro trong tương lai',118),(582,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng nhận định chính xác các rủi ro có thể xảy ra trong dài hạn\n- Đánh giá toàn diện được các cơ hội và rủi ro trong thực tế tổ chức\n- Xây dựng được chiến lược biến rủi ro thành cơ hội phát triển lâu dài\n- Có sẵn phương án phối hợp các phòng ban để sẵn sàng xử lý rủi ro',118),(583,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'- Ra quyết định mà không truyền thông rõ ràng tới nhân viên\n-  Không hỗ trợ, thúc đẩy nhân viên trong quá trình giao việc \n-  Tìm lỗi của nhân viên để chỉ trích mà không tính đến vai trò và trách nhiệm của bản thân',119),(584,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'- Đảm bảo nhân viên bị ảnh hưởng bởi một quyết định của mình biết những gì đang diễn ra\n- Luôn đảm bảo mọi người trong nhóm được truyền đạt đầy đủ những thông tin cần thiết\n- Thúc đẩy, hỗ trợ nhóm/đơn vị làm việc hiệu quả.',119),(585,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'- Xem trọng chuyện hoàn thành công việc hơn là trò chuyện, kết nối với mọi người\n- Giao việc nhiều hơn là lắng nghe những băn khoăn hoặc thử thách nhân viên đang gặp phải\n- Không biết nhiều về những gì đang diễn ra trong cuộc sống cá nhân của các đồng nghiệp\n- Được nhân viên mô tả là người hiệu quả nhưng lạnh lùng',119),(586,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'- Giúp nhân viên phát triển sự nghiệp\n- Có thể trò chuyện với bất cứ ai trong đội ngũ về hầu hết các vấn đề, bất kể công việc hay cuộc sống riêng\n- Không thể thiết lập mối quan hệ tốt với số ít người Cảm thấy Không thể đến gần Được\n- Tiếp nhận những đánh giá tốt về năng lực làm việc, bao gồm các phản hồi từ đồng nghiệp lẫn nhân viên trực Tiếp',119),(587,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'- Ở cạnh những người thông minh, kết nối, truyền được cảm hứng để mọi người phát triển hết khả năng\n- Dẫn dắt một đội ngũ sáng tạo và thu được kết quả vượt mục tiêu đề ra\n- Có một đội ngũ hợp tác tốt với nhau, tình nguyện hỗ trợ nhau vì mục tiêu chung\n- Được mời làm diễn giả trong các chương trình về lãnh đạo, hoặc tập huấn nâng cao năng lực lãnh đạo cho người khác.\n',119),(588,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'- Biết được quy trình, các biểu mẫu và thời gian quy định về việc lập kế hoạch AOP\n- Chưa xác định được các nhiệm vụ cần thực hiện hoặc Chưa hiểu rõ yêu cầu trong việc lập kế hoạch AOP\n-  Không xác định được nguồn lực cần thiết (máy móc, thiết bị, vật tư, tài chính hoặc nhân lực) để hoàn thành nhiệm vụ được giao',120),(589,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'- Hiểu tổng quan về quy trình lập kế hoạch AOP\n- Giải thích được các biểu mẫu và phối hợp các đơn vị trong quá tình lập kế hoạch AOP \n- Chuẩn bị một phần thông tin, dữ liệu phục vụ việc lập kế hoạch AOP',120),(590,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'- Chuẩn bị đầy đủ thông tin, số liệu phục vụ việc lập kế hoạch AOP\n- Hoàn tất việc lập AOP đầy đủ nội dung và hoàn thành đúng tiến độ thực hiện',120),(591,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'- Phân tích các vấn đề thường sai sót, số liệu không chính xác trong quá trình lập kế hoạch AOP \n- Điều phối các đơn vị liên quan trong việc lập kế hoạch AOP',120),(592,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'- Đề xuất các giải pháp điều chỉnh phương thức phối hợp trong việc trong lập kế hoạch AOP\n- Tổ chức cơ sở dữ liệu, báo cáo phục vụ cho việc tổ chức lập kế hoạch AOP',120),(593,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'- Biết rõ mục đích, quy định uỷ quyền, phân quyền\n- Biết các nội dung được phân quyên, ủy quyền\n- Biết được phương pháp giám sát việc phân quyền, ủy quyền',121),(594,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'- Hiểu được trách nhiệm và quyền hạn trong phân quyền và ủy quyền\n- So sánh được phân quyền và ủy quyền ',121),(595,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'- Thực hiện phân quyền và giám sát công tác phân quyền hiệu quả \n- Thực hiện các hoạt động ủy quyền theo đúng chức năng nhiệm vụ \n- Có hoạt động giám sát công tác phân quyền và ủy quyền',121),(596,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'- Xác định các lỗi thường gặp trong quá trình thực hiện ủy quyền và phân quyền \n- Khi phân quyền kèm theo các giải pháp kiểm soát rủi ro trong phân quyền và ủy quyền',121),(597,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'- Xây dựng hệ thống quy định hướng dẫn việc phân quyền, ủy quyền hiệu quả\n- Đào tạo, hướng dẫn công tác phân quyền, ủy quyền tại đơn vị',121),(598,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'- Biết được quy trình xây dựng, kiểm soát và đánh giá thực hiện ngân sách\n- Biết được các khoản mục đưa vào quản lý, đánh giá ngân sách \n- Biết được phương pháp tính toán và dự trù ngân sách ',122),(599,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'- Xác định và phân biệt được các loại và khoản mục chi phí.\n- Hiểu về các chỉ tiêu được đưa vào kế hoạch ngân sách \n- Đánh giá tình hình thực hiện ngân sách thông qua các chỉ số được xây dựng sẵn',122),(600,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'- Triển khai việc xây dựng, kiểm soát và đánh giá ngân sách định kỳ tại đơn vị \n- Xây dựng các chỉ số theo dõi, đánh giá chỉ tiêu ngân sách định kỳ \n- Xác định các chỉ tiêu có khả năng vượt ngân sách và lên kế hoạch kiểm soát ',122),(601,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'- Xác định được các sai sót phát sinh trong quá trình xây dựng, kiểm soát và đánh giá ngân sách \n- Phân loại nhóm ngân sách có khả năng vượt so với kế hoạch được lập \n- Dự phòng các giải pháp khi xảy ra trường hợp vượt ngân sách',122),(602,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'- Xây dựng quy định hướng dẫn việc lập ngân sách\n- Đào tạo, hướng dẫn việc kiểm soát ngân sách \n- Phát triển hệ thống báo cáo nhằm kiểm soát ngân sách ',122),(603,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Toeic 205 - 400 (2 kỹ năng, kết quả bài kiểm tra tại Công ty)',123),(604,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Toeic 405 - 600 (2 kỹ năng, kết quả bài kiểm tra tại Công ty)',123),(605,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Toeic 605 - 700 (2 kỹ năng, kết quả bài kiểm tra tại Công ty)',123),(606,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Toeic 705 - 800 (2 kỹ năng, kết quả bài kiểm tra tại Công ty)',123),(607,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Toeic Trên 800 (2 kỹ năng, kết quả bài kiểm tra tại Công ty)',123),(608,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Tin học văn phòng A 5 điểm (Kết quả bài kiểm tra tại Công ty)',124),(609,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Tin học văn phòng A 6 điểm (Kết quả bài kiểm tra tại Công ty)',124),(610,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Tin học văn phòng A 7 điểm (Kết quả bài kiểm tra tại Công ty)',124),(611,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Tin học văn phòng A 8 điểm (Kết quả bài kiểm tra tại Công ty)',124),(612,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Tin học văn phòng A 9-10 điểm (Kết quả bài kiểm tra tại Công ty)',124),(613,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng diễn đạt được ý kiến của mình, dù không phải lúc nào cũng mạch lạc và chính xác.\n- Chủ động lắng nghe, nhưng không biết cách khơi gợi được phản hồi của đối phượng.',125),(614,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng diễn đạt rành mạch tới nhiều đối tượng, tuy nhiên ngôn ngữ và giọng điệu trong nhiều trường hợp không chính xác.\n- Có ý thức khơi gợi giao tiếp hai chiều, dù đôi khi không thực sự khéo léo.\n- Chủ động lắng nghe, thể hiện được thái độ quan tâm tới đối phương.',125),(615,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng diễn đạt rành mạch, rõ ràng các nội dung cơ bản tới nhiều đối tượng khác nhau.\n- Thường vận dụng được đúng giọng điệu và ngôn ngữ trong các trường hợp giao tiếp.\n- Thường xuyên lắng nghe, quan tâm tới đối phương và biết khơi gợi giao tiếp hai chiều một cách khéo léo.',125),(616,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng thuyết trình rành mạch các khái niệm phức tạp tới nhiều đối tượng khác nhau.\n- Xử lí khéo léo được các tình huống phát sinh trong giao tiếp, linh hoạt trong cách sử dụng ngôn ngữ và giọng điệu.\n- Nắm rõ những gì mình cần truyền đạt đến người nghe.\n- Biết lắng nghe và thường chấp nhận những phản hồi mà người khác dành cho mình.',125),(617,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể khả năng thực hiện tất cả những yêu cầu sau:\n- Tự tin trình bày các vấn đề phức tạp và nhạy cảm tới mọi đối tượng (từ các đối tượng lãnh đạo cấp cao, người ngang hàng hoặc các đối tượng yếu thế hơn).\n- Luôn tạo được ấn tượng là một người biết lắng nghe và sẵn sàng chấp nhận phản hồi mà người khác dành cho mình.\n- Ngôn ngữ và giọng điệu linh hoạt, có sức thuyết phục và gây được ảnh hưởng lên người khác.\n- Có chiến lược rõ ràng trong giao tiếp.',125),(618,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Biết kiểm soát thái độ của bản thân khi gặp phản đối nhưng còn lúng túng khi suy nghĩ phương án.\n- Có khả năng diễn đạt rành mạch ý kiến cá nhân nhưng không tạo được sự thuyết phục.',126),(619,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể:\n- Chủ động lắng nghe nguyện vọng của đối phương, trình bày rành mạch phương án đề xuất dù không thực sự thuyết phục',126),(620,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Tạo dựng được sự tin tưởng của một tập thể theo đề xuất của cá nhân.\n- Biết hướng xử lí đúng khi bị phản đối.\n- Luôn đặt mình vào tình thế của đối phương, nhưng phương án đề xuất chưa thực sự thuyết phục.',126),(621,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể thực hiện được tất cả những yêu cầu sau:\n- Thuyết phục được đội ngũ cấp cao theo các đề xuất của cá nhân.\n- Biết xử lí khôn khéo khi bị phản đối.\n- Luôn đặt mình vào tình thế của đối phương và đưa ra được những phương án đề xuất hợp lí.\n- Diễn đạt rành mạch, rõ ràng, có tính thuyết phục cao.',126),(622,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể thực hiện được tất cả những yêu cầu sau:\n- Thuyết phục được đội ngũ quản lý cấp cao đồng ý với các thay đổi lớn, có tầm ảnh hưởng rộng.\n- Biết điều chỉnh thái độ của bản thân linh hoạt theo tình huống.\n- Thấu hiểu được chính xác nhu cầu của đối phương, đưa ra được phương án khéo léo khiến đối phương hài lòng.\n- Ngôn ngữ và giọng điệu linh hoạt, có tính thuyết phục cao và tạo được ảnh hưởng lên đối phương.',126),(623,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có trách nhiệm với công việc chung, tuân theo các chỉ dẫn của lãnh đạo.\n- Hòa đồng, sẵn sàng san sẻ và giúp đỡ các thành viên trong nhóm.',127),(624,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể thực hiện được tất cả những yêu cầu sau:\n- Chủ động chia sẻ và giúp đỡ các thành viên trong nhóm.\n- Nắm được vai trò của từng thành viên trong nhóm.',127),(625,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể thực hiện được tất cả những yêu cầu sau:\n- Xây dựng được mối quan hệ tốt đẹp với các thành viên trong và ngoài nhóm.\n- Nắm được năng lực và vai trò của từng thành viên trong nhóm.\n- Tạo dựng và cổ vũ tinh thần hợp tác trong nhóm.',127),(626,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể thực hiện được tất cả những yêu cầu sau:\n- Khơi dậy tinh thần hợp tác giữa các nhóm bằng cách cổ vũ các thành viên cùng chia sẻ và giúp đỡ lẫn nhau.\n- Cổ vũ, tạo động lực cho các thành viên trong nhóm cùng đạt được mục tiêu chung.\n- Xây dựng được một môi trường làm việc trong nhóm cởi mở, thân thiện.\n- Tổ chức được phân công công việc trong nhóm hiệu quả dựa trên năng lực của từng thành viên.',127),(627,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể thực hiện được tất cả những yêu cầu sau:\n- Xây dựng và thúc đẩy tinh thần hợp tác giữa các nhóm để cùng đạt được mục tiêu chung của doanh nghiệp.\n- Tạo dựng một tập thể vững mạnh nhờ khai thác hiệu quả năng lực của từng nhóm và kết nối các nhóm bằng mục tiêu, giá trị và tầm nhìn chung.\n- Tạo dựng văn hóa làm việc nhóm trong tổ chức.',127),(628,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Áp dụng đúng quy trình để xử lí tình huống mà không có khả năng xử lí tình huống bất ngờ, không cân nhắc các mặt của quy trình.\n- Chỉ có khả năng quyết định các vấn đề nhỏ lẻ, không để lại hậu quả nghiêm trọng.',128),(629,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Đưa ra quyết định kịp thời, đúng đắn trong các tình huống quen thuộc và không quá nghiêm trọng, tuy nhiên sẽ bối rối nếu có tình huống ngoại lệ bất ngờ xảy ra.\n- Có ý thức đánh giá các phương án xử lí tình huống.\n- Phải nhờ trợ giúp trong tình huống thiếu dữ kiện để ra quyết định.\n- Có ý thức nhìn nhận vấn đề khách quan nhưng còn hành động theo chủ quan.',128),(630,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng phân tích một tình huống phức tạp, nhìn nhận được mối quan hệ giữa các yếu tố trong tình huống.\n- Đưa ra quyết định kịp thời, đúng đắn trong các tình huống có độ khó trung bình.',128),(631,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khà năng thực hiện tất cả những yêu cầu sau:\n- Đưa ra được giải pháp hiệu quả, kịp thời trong một tình huống chưa có tiền lệ.\n- Chủ động thu thập thêm dữ liệu và xử lí một hệ thống thông tin lớn, phức tạp trong thời gian ngắn, đưa ra được dự đoán về xu hướng và các hệ quả có khả năng xảy ra.',128),(632,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Luôn nhìn nhận vấn đề trung lập, khách quan ở nhiều góc độ.\n- Có khả năng tổng hợp và hệ thống hóa thông tin phức tạp.\n- Nhìn nhận được vấn đề ở quy mô lớn (mang tầm chiến lược) và đề xuất được những phương án sáng tạo có tính đột phá.\n- Tiên liệu được các tình huống và đưa ra được một hệ thống giải pháp hiệu quả, kịp thời trong những tình huống phức tạp, mơ hồ, thiếu thông tin.\n',128),(633,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Nhận diện được các yếu tố sáng tạo.\n- Xem xét các ý tưởng sáng tạo từ các thành viên khác trong nhóm.',129),(634,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Tiếp thu ý tưởng sáng tạo từ các cá nhân khác và có đề xuất hoàn thiện các ý tưởng sáng tạo đó.\n- Làm việc với các cá nhân khác để cùng nghĩ ra cách thức tiếp cận hiệu quả đối với vấn đề.',129),(635,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả các yêu cầu sau:\n- Đánh giá hiệu quả các cách làm cũ và đề xuất xây dựng phương án cải tiến.\n- Chủ động tìm kiếm cách thức hiệu quả nhất để thực hiện công việc chung.',129),(636,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Thiết kế được các cách làm mới và hiệu quả nhất để thực hiện các mục tiêu của doanh nghiệp.\n- Thu thập từ nhiều nguồn thông tin và tư duy được nhiều phương án để tiếp cận một vấn đề.\n- Xây dựng được môi trường làm việc thúc đẩy sáng tạo ở các nhóm làm việc.',129),(637,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Xây dựng được phương pháp, quy trình mới có khả năng ứng dụng ở quy mô doanh nghiệp với tầm ảnh hưởng sâu rộng.\n- Đưa ra cách giải quyết triệt để được cho những vấn đề nghiêm trọng của doanh nghiệp.\n- Tổ chức được bộ máy làm việc kiểu mới giúp cải thiện hiệu suất chung của cả doanh nghiệp.\n- Có khả năng tư duy được cách làm mới trong hoàn cảnh rất thiếu hoặc không có dữ kiện.',129),(638,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Biết được quy định về thể thức trình bày một văn bản hành chánh.\n- Phân biệt được các loại văn bản hành chánh và văn phong tương ứng.',130),(639,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Soạn thảo được những văn bản hành chánh mang tính chất lập lại theo mẫu với sự hướng dẫn của người khác.\n- Áp dụng đúng thể thức trình bày văn bản theo quy định.',130),(640,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả các yêu cầu sau:\n- Soạn thảo được các văn bản hành chánh không có tính chất lập lại toàn bộ, chưa có mẫu toàn bộ.\n- Thể hiện được ý đồ của người yêu cầu soạn thảo.',130),(641,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Soạn thảo được các văn bản chưa có mẫu, hoàn toàn mới.\n- Văn bản có nội dung phức tạp, đòi hỏi nghiên cứu, tổng hợp nhiều tài liệu và quy định của pháp luật.',130),(642,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác.',130),(643,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng kết nối và duy trì các mối quan hệ cá nhân.\n- Chưa có khả năng phân loại và đặt ưu tiên cho các mối quan hệ.',131),(644,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng tạo dựng network trong các sự kiện, các cơ hội gặp mặt mà mình tham dự.\n- Giữ được mối quan hệ tốt đẹp với các bộ phận liên quan.',131),(645,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả các yêu cầu sau:\n- Khai thác hiệu quả các mối quan hệ xung quanh và tận dụng để mở rộng network khi có cơ hội.\n- Xây dựng được network tương đối đa dạng và phục vụ được cho mục đích chung của công việc.',131),(646,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Chủ động tìm kiếm các cơ hội networking ở nhiều lĩnh vực, không ngừng mở rộng network.\n- Xây dựng được mối quan hệ hợp tác chiến lược lâu dài với nhiều đối tượng, trong đó có cả cấp quản lý cấp cao..',131),(647,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Tự xây dựng và điều phối một cộng đồng để qua đó có mạng lưới đối tác cùng khách hàng tiềm năng.\n- Có khả năng xác định những mối quan hệ nào là quan trọng, và có phương án hành động trong từng mối quan hệ.\n- Xây dựng được mối quan hệ hợp tác chiến lược lâu dài với cả những lãnh đạo cấp cao.',131),(648,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Chưa biết cách đặt thứ tự ưu tiên cho công việc.\n- Sẽ không hoàn thành được công việc theo đúng deadline nếu như khối lượng công việc lớn hơn thường ngày.',132),(649,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có kế hoạch công việc cho bản thân.\n- Hoàn thành được các công việc của bản thân theo đúng deadline với khối lượng công việc lớn.\n- Chưa có khả năng tổ chức công việc cho đội nhóm.',132),(650,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả các yêu cầu sau:\n- Có khả năng lên kế hoạch công việc cho nhóm.\n- Biết cách đặt thứ tự ưu tiên ưu tiên cho công việc.\n- Có khả năng hoàn thành khối lượng công việc lớn, nhưng dễ mất kiểm soát trong những tình huống căng thẳng và nhạy cảm.',132),(651,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng lên kế hoạch hành động chi tiết theo từng giai đoạn để hoàn thành mục tiêu cho công ty, sẵn sàng ứng phó với nhiều tình huống.\n- Phân phối nguồn lực chặt chẽ, biết đặt thứ tự ưu tiên.\n- Có khả năng hoàn thành khối lượng công việc lớn trong cả những tình huống áp lực.',132),(652,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Sắp xếp được hệ thống công việc ở quy mô chiến lược.\n- Phân phối một nguồn lực lớn một cách chặt chẽ, biết đặt thứ tự ưu tiên chính xác.\n- Bao quát được hiệu quả sử dụng nguồn lực.\n- Luôn giữ được mọi việc trong tầm kiểm soát.',132),(653,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Không có mục tiêu cụ thể, chỉ cam kết đầu ra.\n- Duy trì được công việc dưới áp lực của trở ngại cho đến khi có giải pháp khả thi.\n- Có ý thức duy trì nhưng không đảm nhận được đồng thời chất lượng, dịch vụ và năng suất.\n- Báo cáo kết quả theo mẫu có sẵn.',133),(654,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Thiết lập được mục tiêu nhưng còn sai số đối với khả năng làm được.\n- Có tinh thần ứng phó và chịu trách nhiệm giải quyết các trở ngại.\n- Theo dõi và kịp thời xử lý các vấn đề gây ảnh hưởng đến chất lượng, dịch vụ và năng suất.',133),(655,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả các yêu cầu sau:\n- Thiết lập các mục tiêu rõ ràng và cụ thể.\n- Có khả năng nhìn nhận về mức độ của trở ngại, chuẩn bị sẵn phương án chủ động giảm thiểu tác động của trở ngại.\n- Có khả năng đánh giá kết quả đa chiều, kịp thời xử lý các thiếu sót đơn giản, rút ra được bài học kinh nghiệm.',133),(656,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng thiết lập mục tiêu dài hạn và ngắn hạn dựa trên mục tiêu chung của tổ chức\n- Có khả năng phân tích lợi hại của trở ngại, chuẩn bị sẵn tinh thần và phương án chủ động phòng tránh, loại bỏ trở ngại\n- Tạo động lực cho các thành viên, chủ động giám sát chặt chẽ và tìm cách nâng cao chất lượng, dịch vụ và năng suất làm việc\n- Có khả năng đánh giá kết quả toàn diện, lập ra phương án xử lý thiếu sót, lấy đó làm cơ sở nền tảng cho lần sau',133),(657,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có khả năng thiết lập các mục tiêu dài hạn và ngắn hạn gắn bó chặt chẽ với việc đánh giá kết quả lần trước.\n- Dự đoán và phân tích chính xác các trở ngại và rủi ro có thể xảy ra; có chiến lược thử nghiệm và chốt được phương án biến mọi trở ngại thành cơ hội.\n- Liên tục tìm kiếm, thử nghiệm và tận dụng cơ hội mới để cải thiện chất lượng, dịch vụ và gia tăng năng suất.\n- Có khả năng đánh giá kết quả toàn diện, chủ động nghiên cứu hiệu quả các giải pháp và tiếp tục thử các giải pháp mới cho đến khi đạt được kết quả mong đợi.',133),(658,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Có thể thực hiện lặp đi lặp lại một thao tác cụ thể\n- Chỉ thực hiện các công việc khó khăn khi có người hướng dẫn cụ thể và cùng thực hiện',134),(659,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Nghiêm túc thực hiện kỷ luật, nội quy dù có khắt khe.\n- Chấp nhận thực hiện các công việc khó khăn khi được yêu cầu.\n- Đôi khi bị ảnh hưởng tâm lý bởi thất bại, dư luận, lời trách mắng, v.v.',134),(660,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả các yêu cầu sau:\n- Duy trì được các thói quen tốt trong thời gian dài.\n- Nhận thức được điểm yếu của bản thân và không ngừng trau dồi.\n- Sẵn sàng đảm nhận các công việc khó khăn, đòi hỏi nhiều công sức.',134),(661,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Không nản chí, biết cách biến trở ngại thành động lực để cố gắng.\n- Biết tự trấn an bản thân, luôn giữ được bình tĩnh trước áp lực.\n- Biết tận dụng những cơ hội nhỏ để phát triển từng bước.',134),(662,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Biết lập kế hoạch hành động để thực hiện mục tiêu và cẩn thận thực hiện từng nhiệm vụ nhỏ..\n- Chủ động tự tìm tòi nâng cao hiểu biết, kỹ năng chuyên môn.\n- Kiên nhẫn thử nghiệm, cải tiến những ý tưởng mới trước khi chính thức áp dụng.',134),(663,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,1,'Cá nhân chỉ vận dụng được năng lực trong những tình huống cơ bản nhất và sẽ cần rất nhiều chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Cần sự nhắc nhở nhiều lần để thực hiện công việc đã giao.\n- Chưa hoàn thành được nhiệm vụ mặc dù có nhiều nỗ lực.',135),(664,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,2,'Cá nhân có thể vận dụng được năng lực trong những tình huống với độ khó trung bình và vẫn thường cần được hỗ trợ, hướng dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Chỉ thực hiện công việc khi được yêu cầu bởi người quản lý trực tiếp hoặc khách hàng.\n- Hoàn thành được nhiệm vụ nhưng cần sự giám sát, chỉ dẫn của người quản lý.',135),(665,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,3,'Cá nhân có thể vận dụng được năng lực trong những tình huống khó khăn, dù đôi khi vẫn cần được chỉ dẫn từ người khác. Cụ thể có khả năng thực hiện tất cả các yêu cầu sau:\n-  Thực hiện công việc trong phạm vi trách nhiệm mà không cần yêu cầu hoặc giám sát của người quản lý trực tiếp.\n-  Hành động ngay khi đối mặt với các vấn đề hoặc nhận biết tình huống cần hành động.\n- Chủ động đề đạt kế hoạch làm việc của bản thân khi được giao việc và nỗ lực hoàn thành kế hoạch.',135),(666,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,4,'Cá nhân có thể vận dụng được năng lực trong những tình huống khá khó khăn, mà hầu như không cần hướng dẫn. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n-  Đề xuất cách thức giải quyết vấn đề, cải tiến quy trình mà không cần đợi yêu cầu.\n- Thực hiện các nhiệm vụ nằm ngoài trách nhiệm nhằm hỗ trợ cho bộ phận hoặc Công ty.\n- Có chú trọng phân tích để phát hiện rủi ro và lập phương án phòng ngừa trong quá trình.',135),(667,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,5,'Cá nhân chủ động vận dụng được kĩ năng này trong cả những tình huống đặc biệt khó khăn. Cá nhân có thể tự tin truyền đạt kĩ năng này cho người khác. Cụ thể có khả năng thực hiện tất cả những yêu cầu sau:\n- Chủ động điều chỉnh, thích ứng phương pháp và cách tiếp cận hiện tại để đáp ứng tốt hơn yêu cầu.\n- Tìm kiếm ý tưởng và giải pháp đã đang thực hiện ở các môi trường khác và áp dụng chúng vào tổ chức một cách hiệu quả. ',135),(668,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,1,'Biết được toàn bộ hệ thống tài khoản và nội dung của từng tài khoản theo quy định của TT200 và chuẩn mục kế toán Việt Nam. ',136),(669,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,2,'Hiểu cách hạch toán các phần hành kế toán theo quy định của TT200.',136),(670,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,3,'Áp dụng quy định của TT200 để hạch toán các phần hành kế toán tại Công ty.',136),(671,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,4,'Rà soát và phát hiện được các trường hợp hạch toán sai và đưa ra phương án điều chỉnh.',136),(672,