1',NULL,0,NULL,NULL,0,2,'- Hiểu về công suất máy móc thiết bị của NCC.\n-Biết tình hình sức chứa, kho bãi của NCC.\n- Hiểu về năng lực vận chuyển của NCC.\n- Cập nhật thông tin về tình hình kinh doanh, tài chính của NCC.',204),(1010,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Kiểm tra, giám sát về khả năng cung ứng  hàng hóa từ phía NCC.',204),(1011,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Đối với NCC có sức ảnh hưởng lớn đến hoạt đông SXKD, phải đánh giá NCC hằng năm.\n- Thu thập hồ sơ năng lực của NCC.\n- Đánh giá, phân tích các số liệu trong hồ sơ năng lực của NCC.',204),(1012,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Có những kiến thức chuyên môn về đánh giá NCC,  tư vấn, đưa ra những sáng kiến cải tiến để NCC khắc phục những nhược điểm, sai sót trong quá trình đánh giá.',204),(1013,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Biết kế hoạch, thời gian để đàm phán thương lượng.\n- Biết hồ sơ, số liệu cần thiết đáp ứng cho việc thương lượng.',205),(1014,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'- Hiểu được  mục tiêu của cuộc đàm phán thương lượng.\n- Thu thập, phân tích các số liệu cần thiết đáp ứng cho việc thương lượng.',205),(1015,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Phân chia nhiệm vụ trong quá trình đàm phán.\n- Dự đoán được kết quả đạt được.\n- Chuẩn bị phương án phòng ngừa khi thương lượng không đạt được mục tiêu như mong đợi.\n',205),(1016,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Thực hiện thương lượng một cách nhanh chóng và hiệu quả. \n- Đưa cho những  dự định, cơ hội trong tương lai cho phía bên kia nhằm đạt kết quả thương lượng.',205),(1017,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Hỗ trợ, hướng dẫn cho các đồng nghiệp, cộng sự về những kinh nghiệm, kiến thức trong thương lượng, đàm phán. ',205),(1018,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Biết thủ tục cần thiết cho việc nhập vật tư.\n- Biết những thao tác trên chương trình phần mềm quản lý vật tư.\n- Biết HDCV nhập vật tư.',206),(1019,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'- Hiểu được thủ tục cần thiết cho việc nhập vật tư.\n- Hiểu và thực hiện đúng những thao tác trên chương trình phần mềm quản lý vật tư.\n- Kiểm tra các chứng từ cần thiết trong quá trình nhận vật tư.\n',206),(1020,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Thực hiện đúng những thao tác trên chương trình phần mềm quản lý vật tư.\n- Kiểm tra sự phù hợp các chứng từ trong quá trình nhận vật tư.\n',206),(1021,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Thực hiện  những thao tác trên chương trình phần mềm quản lý vật tư thuần thục, nhanh chóng và có độ chính xác cao.\n- Kiểm tra sự phù hợp các chứng từ trong quá trình nhận vật tư, nhận ra các sai sót của chứng từ. \n',206),(1022,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Hướng dẫn các nhân viên hiểu và thực hiện những thao tác trên chương trình phần mềm quản lý vật tư thuần thục, nhanh chóng và có độ chính xác cao.\n- Hướng dẫn các nhân viên cách thức kiểm tra sự phù hợp các chứng từ trong quá trình nhận vật tư.',206),(1023,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Biết danh mục hàng hóa tồn kho.\n- Biết ý nghĩa của báo cáo nhập xuất tồn.\n- Đọc được báo cáo tồn kho.',207),(1024,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'- Thực hiện kiểm kê định kỳ.\n- Phân lập danh mục các vật tư ứ đọng, chậm luân chuyển. Xác định đơn vị có liên quan đến vật tư ứ đọng, chậm luân chuyển.',207),(1025,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'-  Xem xét việc sử dụng vật tư theo định mức. So sánh việc sử dụng nguyên vật liệu với kế hoạch mua NVL. \n- Liên hệ với các đơn vị có trách nhiệm có xử lý vật tư ứ đọng, chậm luân chuyển. \n- Báo cáo vật tư ứ đọng, chậm luân chuyển trình cấp trên.',207),(1026,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Phân tích giá trị tồn kho.\n- Xác định hàng tồn kho ứ đọng chậm luân chuyển.\n- Đưa ra hướng giải quyết hàng hóa tồn kho chậm luân chuyển.',207),(1027,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Khuyến cáo các đơn vị có liên quan trước khi xác nhận đặt hàng về những hàng hóa có nguy cơ ứ đọng chậm luân chuyển.\n- Hỗ trợ giải quyết hàng tồn kho chậm luân chuyển.\n- Phê duyệt phương án xử lý hàng tồn kho.',207),(1028,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Nhận diện vấn đề phát sinh. \n- Phác thảo các việc cần giải quyết để khắc phục vấn đề phát sinh.',208),(1029,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'- Phân loại và tìm ra vấn đề phát sinh. \n- Xác định đối tượng và chủ thể của  vấn đề phát sinh. ',208),(1030,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Phân tích cách giải quyết vấn đề.\n- Đề xuất giải pháp giải quyết vấn đề.\n- Xác định thời gian để giải quyết vấn đề đó.',208),(1031,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Thực hiện giải quyết vấn đề phát sinh theo đúng hoặc sớm hơn thời gian đã đề ra.\n- Phân tích và đánh giá hiệu quả của việc giải quyết vấn đề phát sinh.',208),(1032,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Dự báo được các vấn đề phát sinh trong công việc.\n- Chủ động hành động trước khi xảy ra vấn đề',208),(1033,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Biết các loại hồ sơ, tài liệu cần lưu trữ.\n- Biết được nơi lưu trữ, các hồ sơ, tài liệu.',209),(1034,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'- Có kiến thức cơ bản về ISO.',209),(1035,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Lưu trữ các loại hồ sơ, tài liệu theo qui trình ISO.\n- Có kiến thức cơ bản về 5S.',209),(1036,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Ứng dụng 5S vào việc quản lý hồ sơ, tài liệu.',209),(1037,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Hướng dẫn lại cho các đồng nghiệp về kiến thức ISO, 5S .\n - Hướng dẫn đồng nghiệp có những kiến thức chuyên môn về quản lý hồ sơ, tài liệu trong ISO.',209),(1038,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Biết các báo cáo phải thực hiện.\n- Biết thời gian phải hoàn thành các báo cáo.\n- Biết các thể thức văn bản của báo cáo.',210),(1039,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'- Thảo luận về các số liệu phải báo cáo.\n- Xác định đối tượng cung cấp số liệu để thực hiện báo cáo.',210),(1040,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Thực hiện báo cáo đúng thời hạn, đúng số liệu và không sai sót.\n- Tuân thủ theo thể thức văn bản đã quy định.',210),(1041,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Phát hiện những sai sót có trong báo cáo. \n- Phân tích các nguyên nhân gây ra sai sót trong báo cáo.\n- Giải pháp để khắc phục các sai sót đó.\n- Hướng dẫn đồng nghiệp thực hiện báo cáo đúng quy định.',210),(1042,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Chỉnh sửa báo cáo.\n- Tư vấn cách thực hiện báo cáo.\n- Phê duyệt báo cáo hoàn chỉnh.',210),(1043,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Biết về danh mục vật tư.\n- Biết được sức chứa vật tư trong kho.\n- Biết cách phân lập vật tư tùy theo tình hình sử dụng.',211),(1044,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'\n- Vẽ sơ đồ kho, lưu trữ vật tư theo sơ đồ kho.\n- Có kiến thức cơ bản về nghiệp vụ quản lý kho.',211),(1045,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'\n- Lưu trữ vật tư theo sơ đồ kho.\n- Hiểu được bản chất, thuộc tính của vật tư (đặc biệt là nguyên liệu).\n',211),(1046,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Lưu trữ vật tư theo sơ đồ kho, tiết kiệm diện tích kho lưu trữ.\n- Sắp xếp lưu trữ vật tư theo bản chất, thuộc tính hóa chất (đặc biệt là nguyên liệu).\n',211),(1047,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Hướng dẫn cho các nhân viên kho về  việc lưu trữ vật tư theo sơ đồ kho, tiết kiệm diện tích kho lưu trữ.\n- Hướng dẫn các nhân viên kho đọc các MSDS, sắp xếp lưu trữ vật tư theo bản chất, thuộc tính hóa chất (đặc biệt là nguyên liệu).\n',211),(1048,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Có kiến thức về quản lý kho và an toàn hàng hóa.',212),(1049,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'- Hiểu các quy định về hàng hóa trong kho.\n- Phân loại nhóm hàng hóa cần kiểm kê\n- Sắp xếp được nhóm hàng hóa cần kiểm kê \n',212),(1050,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Thực hiện tiếp nhận thông tin nhập/ xuất kho.\n- Kiểm tra số lượng hàng hóa nhập/xuất. Định kỳ Kiểm tra nhằm đảm bảo cân bằng nhập-xuất tồn hàng hóa.\n- Kiểm tra chất lượng hàng tồn để kịp thời xử lý hàng hóa suy giảm chất lượng, hư hỏng.\n- Giải quyết khắc phục các công việc có liên quan nhằm đáp ứng yêu cầu khách hàng và các bên liên quan.\n-  Tính toán số liệu sau khi kiểm kê.',212),(1051,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Phát hiện sai sót trong quá trình kiểm kê.\n- Điểu chỉnh các sai sót trong quá trình kiểm kê.\n- Hướng dẫn đồng nghiệp thực hiện việc quản lý kho theo quy định hiện hành.',212),(1052,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Phân loại được các lỗi xảy ra trong quá trình kiểm kê .\n- Phân tích nguyên nhân sai sót trong quá trình kiểm kê.\n- Phân biệt được các cấp độ sai sót trong quá trình kiểm kê.',212),(1053,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Biết về danh mục vật tư.\n- Biết được phiếu lãnh vật tư, phiếu nhập, xuất vật tư trên chương trình quản lý vật tư.\n- Biết tồn kho vật tư.\n- Biết sơ đồ kho, vị trí lưu trữ vật tư trong kho.',213),(1054,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'-Hiểu được chương trình nhập xuất vật tư trong lĩnh vực mình phụ trách.\n- Hiểu các HDCV trong quá trình nhập xuất vật tư.\n- Biết được sức chứa hàng hóa trong kho.\n- Cân đối, rút ngắn thời gian nhập xuất vật tư.',213),(1055,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Thực hiện các thao tác trên chương trình nhập xuất vật tư trong lĩnh vực mình phụ trách.\n- Ghi chép sổ sách khi nhập xuất vật tư.\n- Nhập xuất vật tư, đáp ứng kịp thời cho KHSX.\n- Nhập, xuất vật tư đúng chủng loại, số lượng, lot lô hàng và hạn chế sai sót.\n',213),(1056,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Thực hiện các thao tác trên chương trình nhập xuất vật tư trong lĩnh vực mình phụ trách nhanh chóng.\n- Ghi chép sổ sách khi nhập xuất vật tư chính xác, ít sai sót.\n- Nhập xuất vật tư nhanh chóng, tiết kiệm thời gian và chi phí vận chuyển vật tư.\n\n',213),(1057,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Hướng dẫn các nhân viên kho các thao tác trên chương trình nhập xuất vật tư nhanh chóng.\n- Ghi chép sổ sách khi nhập xuất vật tư chính xác, ít sai sót, dễ tra cứu.\n- Đưa ra những sáng kiến, cải tiến nhằm rút ngắn thời gian nhập xuất vật tư và giảm chi phí vận chuyển, chi phí bốc xếp.\n\n',213),(1058,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Biết các thông tin về năng lực của bên cung cấp dịch vụ thuê ngoài (bốc xếp, vận chuyển hàng hóa).\n- Xác định các vấn đề khi thực hiện quản lý lao động thuê ngoài (danh sách lao đông bên ngoài, kiểm soát lao động mới, kiểm soát sức khỏe, kiểm soát các kỹ năng ATLĐ, ATHC, PCCC, hóa chất tràn vãi...)',214),(1059,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'- Hiểu công việc của các lao động thuê ngoài.\n- Sắp xếp thời gian làm việc, trang bị bảo hộ lao động, trang thiết bị hoạt động.\n- Giám sát các hoạt động giao nhận xếp dỡ.',214),(1060,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Thực hiện kiểm soát các việc liên quan đến hợp đồng đối với lao động thuê ngoài.\n- Kịp thời liên hệ với bên cung cấp dịch vụ để giải quyết các vấn đề phát sinh đến dịch vụ thuê ngoài.',214),(1061,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Phân tích hiệu quả của việc sử dụng dịch vụ thuê ngoài.\n- Hướng dẫn đồng nghiệp trong việc quản lý lao động bên ngoài. ',214),(1062,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Dự báo các vấn đề phát sinh và đưa ra hướng giải quyết đối với dịch vụ thuê ngoài.\n- Sắp xếp lại công việc của dịch vụ thuê ngoài theo kế hoạch phát triển của công ty.',214),(1063,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Có kiến thức cơ bản vềhợp đồng thương mại, kiến thức INCOTERMS.\n- Biết lập các chứng từ có liên quan.',215),(1064,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'- Thực hiện đúng việc lập hợp đồng ngoại thương với đầy đủ các điều khoản quy định cần phải có của hợp đồng. \n- Hiểu rõ và đầy đủ thông tin người bán để giảm thiểu rủi ro phát sinh về phía người bán, gây thiệt hại cho công việc.',215),(1065,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Hoàn thành việc lập hợp đồng ngoại thương, chính xác. Quy định chặt chẽ về các điều khoản vi phạm hợp đồng\n- Hoàn thành việc lập đề nghị thanh toán đối với các phương thức thanh toán quốc tế được quy định trong hợp đồng. \n- Xử lý được các sự cố phát sinh trong việc lập hợp đồng. ',215),(1066,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Phân tích các sự cố có thể phát sinh trong quá trình lập hợp đồng ngoại thương. \n- Hướng dẫn, hỗ trợ đồng nghiệp lập hợp đồng ngoại thương với các điều khoản quy định đầy đủ.',215),(1067,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Dự báo các tình huống phát sinh, tranh chấp, khiếu nại xảy ra. \n- Khi có tranh chấp xảy ra có thể giải quyết một cách thuần thục, mang lại kết quả tốt nhất cho công việc.',215),(1068,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Biết quy trình thủ tục nhập hàng.\n- Biết lập chứng từ liên quan đến hàng hóa tại các đơn vị có liên quan đến việc nhận hàng hóa nhập khẩu (ngân hàng, đại lý hãng tàu, Cục hóa chất, hải quan…)\n- Biết lưu giữ hồ sơ hàng hóa ngoại thương.',216),(1069,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'- Hiểu quy trình thủ tục nhập hàng.\n- Hiểu các thủ tục có liên quan.\n- Phân loại hồ sơ nhằm đảm bảo hàng hóa được nhận về kho đầy đủ, nhanh chóng.',216),(1070,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Thực hiện khai báo Hải quan và các thủ tục có liên quan hoàn chỉnh, đúng hạn.\n- Xử lý được các sự cố phát sinh trong quá trình giao nhận.',216),(1071,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Phân tích nguyên nhân các sự cố phát sinh và đưa ra hướng giải quyết tránh lặp lại sự cố.\n- Hướng dẫn đồng nghiệp các công việc nhận hàng hóa ngoại thương.',216),(1072,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Dự báo các tình huống phát sinh và giải pháp khắc phục trong việc thực hiện giao nhận hàng hóa ngoại thương',216),(1073,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Biết các dòng sản phẩm công ty đang kinh doanh, và gia công.\n- Biết nhu cầu của từng dòng sản phẩm trong mỗi chu kỳ.',217),(1074,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'- Hiểu về chủng loại sản phẩm.\n- Hiểu về quy trình sản xuất của từng loại sản phẩm.\n- Hiểu cơ cấu sản phẩm và máy móc thiết bị sản xuất từng loại sản phẩm.',217),(1075,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Nắm vững  công suất máy và năng suất lao động.\n- Phân bổ sản lượng cần sản xuất theo cơ cấu sản phẩm, chủng loại sản phẩm và công suất máy để đạt hiệu quả.',217),(1076,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Sắp xếp kế hoạch sản xuất đạt hiệu quả cao nhất.\n- Phối hợp hiệu quả giữa các đơn vị.\n- Giải quyết các tình huống phát sinh không mong muốn (nhu cầu bán hàng tăng ngoài dự kiến, máy móc thiết bị hư ngoài dự kiến, thiếu hụt lao động …).\n- Hướng dẫn đồng nghiệp thực hiện công việc lập kế hoạch sản xuất.',217),(1077,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Dự báo các tình huống phát sinh và giải pháp để tránh xảy ra các tình huống đó.\n- Khuyến cáo các sự cố có thể xảy ra trong quá trình lập kế hoạch sản xuất.\n- Soạn thảo, ban hành Quy trình Lập kế hoạch sản xuất.',217),(1078,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Biết danh mục sản phẩm hàng hóa dịch vụ của công ty có trên phần mềm.\n- Biết các dữ liệu có trên phần mềm quản lý tiêu thụ sản phẩm và phần mềm giao nhận của công ty.',218),(1079,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'- Hiểu được chi tiết các danh mục trong phần mềm tiêu thụ sản phẩm và phần mềm giao nhận.\n- Sử dụng được phần mềm tiêu thụ sản phẩm và giao nhận.\n- Phân biệt được các dữ liệu có trên phần mềm phục vụ cho mục đích tổng hợp số liệu và báo cáo.',218),(1080,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Trích xuất dữ liệu từ phần mềm, tổng hợp và phân tích các số liệu cần thiết phù hợp với  nhu cầu công việc. \n- Thực hiện báo cáo số liệu khi có yêu cầu.',218),(1081,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Phân tích số liệu báo cáo, nhận định và đánh giá số liệu.\n- Hướng dẫn đồng nghiệp thực hiện việc phân tích dữ liệu.',218),(1082,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Dự đoán và đưa ra nhu cầu quý / năm phù hợp với nhu cầu thị trường và khả năng cung ứng, sản xuất của công ty.\n- Hỗ trợ các đơn vị có liên quan sử dụng số liệu đã có để lên kế hoạch dài hạn.\n- Soạn thảo, ban hành Quy trình Phân tích và tổng hợp số liệu',218),(1083,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,1,'- Biết tổng hợp số liệu bán hàng hàng tuần, hàng tháng.\n- Biết nhu cầu kinh doanh từng loại sản phẩm hàng tuần, hàng tháng theo dự báo từ PKD.',219),(1084,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,2,'- So sánh, phân tích dữ liệu giữa nhu cầu đưa ra và thực tế bán hàng hàng tuần / tháng.',219),(1085,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,3,'- Đưa ra nhu cầu sản xuất hàng tuần hàng tháng.\n- Họp kế hoạch sản xuất và phân bổ ngày sản xuất phù hợp với tình hình bán hàng.',219),(1086,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,4,'- Cân đối hàng hóa đảm bảo đủ cho phòng kinh doanh bán hàng.\n- Hướng dẫn đồng nghiệp thực hiện việc cân đối hàng hóa sản xuất với nhu cầu bán hàng, lên kế hoạch sản xuất.\n- Giải quyết các tình huống phát sinh không mong muốn khi nhu cầu và thực tế không giống nhau.\n- Phối hợp hiệu quả giữa các đơn vị.',219),(1087,'2020-02-04 16:35:21',NULL,0,NULL,NULL,0,5,'- Quản lý lượng hàng hóa tồn kho thấp nhất mà vẫn đáp ứng đủ nhu cầu bán hàng.\n- Dự báo các tình huống có thể phát sinh và giải pháp để tránh xảy ra các tình huống đó.\n- Soạn thảo, ban hành quy trình và tiêu chuẩn thực hiện cân đối hàng hóa sản xuất.',219),(1088,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,1,'Nắm được các sản phẩm của Công ty, thông tin về Công ty, tính được giá bán và các nội dung khi gặp khách hàng',220),(1089,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,2,'Nhận dạng được nhu cầu của khách hàng để chào giá cho phù hợp',220),(1090,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,3,'Lập được bảng chào giá các sản phẩm của Công ty, giải đáp được các yêu cầu khác của khách hàng, chu đáo với khách hàng, tôn trọng khách hàng.',220),(1091,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,4,'Thương lượng, thuyết phục, đưa ra các giải pháp để làm hài lòng khách hàng ở mức cao nhất.',220),(1092,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,5,'Thương lượng, thuyết phục, đưa ra các giải pháp để đi đến khách hàng đồng ý mua hàng.',220),(1093,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,1,'Biết và liệt kê được các loại chứng từ cần phải làm đối với một đơn hàng xuất khẩu (Invoice, Packing List, Bill of Lading, v.v)',221),(1094,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,2,'Làm được các chứng từ căn bản đối với bất kỳ đơn hàng xuất khẩu (Invoice, Packing List, Bill of Lading, Certificate of Origin)',221),(1095,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,3,'Làm được các chứng từ căn bản đối với bất kỳ đơn hàng xuất khẩu đúng hạn, không sai sót.',221),(1096,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,4,'Làm được các chứng từ căn bản và chứng từ phát sinh thêm đối với bất kỳ đơn hàng xuất khẩu trước hạn, không sai sót.',221),(1097,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,5,'Kiến tạo cách làm để làm được bất kỳ các loại chứng từ nào phát sinh thêm trong nghiệp vụ của mình đối với bất kỳ đơn hàng xuất khẩu theo yêu cầu trước hạn và không sai sót.',221),(1098,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,1,'Thu thập được thông tin về thị trường, đối thủ cùng ngành.',222),(1099,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,2,'Đưa ra một số nhận xét ở mức cơ bản',222),(1100,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,3,'Đưa ra một số nhận xét và kiến nghị, giải pháp cho cấp trên.',222),(1101,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,4,'Đưa ra một số nhận xét và kiến nghị, giải pháp có khả năng xử lý vấn đề cạnh tranh trên thị trường.',222),(1102,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,5,'Dự báo được xu hướng của thị trường và đối thủ để đưa ra chiến lược, giải pháp đi trước đón đầu.',222),(1103,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,1,'Nhận biết được yêu cầu của khách hàng và triển khai yêu cầu này tới các đơn vị, phòng ban liên quan.',223),(1104,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,2,'Làm rõ được các yêu cầu của khách hàng và thực hiện theo quy trình phát triển sản phẩm mới có sự hướng dẫn của trưởng nhóm/cấp trên trực tiếp.',223),(1105,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,3,'Nắm được yêu cầu của khách hàng và thực hiện theo quy trình phát triển sản phẩm mới không cần sự hướng dẫn của trưởng nhóm/cấp trên trực tiếp.',223),(1106,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,4,'Phân tích được yêu cầu của khách hàng và thực hiện theo quy trình phát triển sản phẩm mới không cần sự hướng dẫn của trưởng nhóm/cấp trên trực tiếp ngay cả khi các yêu cầu này khác lạ so với sản phẩm/yêu cầu tương tự trước đây.',223),(1107,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,5,'Tư vấn được sản phẩm phù hợp với nhu cầu của khách hàng mà lại có giá cạnh tranh và tính khả thi cao.',223),(1108,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,1,'Mô tả được quy trình xử lý khiếu nại khách hàng',224),(1109,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,2,'Thực hiện theo đúng quy trình khi tiếp nhận một khiếu nại từ khách hàng',224),(1110,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,3,'Hoàn tất một khiếu nại khách hàng và giải quyết cho khách hàng ổn thỏa theo sự hướng dẫn của cấp trên. ',224),(1111,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,4,'Hoàn tất một khiếu nại khách hàng và giải quyết cho khách hàng ổn thỏa không cần sự hướng dẫn của cấp trên trong phạm vi được phân/ủy quyền. ',224),(1112,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,5,'Thiết lập biện pháp, hướng dẫn các đơn vị liên quan giải quyết thỏa mãn bất kỳ một khiếu nại khách hàng nào mà không cần sự hướng dẫn của cấp trên. Xây dựng quy trình xử lý KNKH',224),(1113,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,1,'Xác định được nội dung, mục tiêu hội họp và các công tác chuẩn bị.',225),(1114,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,2,'Sắp xếp, chuẩn bị được cuộc họp với khách hàng với các tiêu chí: nội dung họp, địa điểm họp, nhân sự họp, giấy tờ, chứng từ họp, các dụng cụ, vật phẩm, mẫu mã cần chuẩn bị cho cuộc họp.',225),(1115,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,3,'Tham gia dự họp, ghi nhận, trao đổi, giải đáp với khách hàng về các yêu cầu của các bên. Thuyết trình về Công ty và sản phẩm (khi cần)',225),(1116,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,4,'Chủ trì cuộc họp và ra được đa số các quyết định tại cuộc họp để đi đến thống nhất.',225),(1117,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,5,'Quyết định được các giải pháp cho bất kỳ nội dung gì để cuộc họp đi đến thống nhất trên tinh thần hợp tác, vui vẻ và hai bên cùng có lợi.',225),(1118,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,1,'Trình bày được quy trình làm việc với các đơn vị vận tải về kế hoạch nhận hàng tại Công ty mỗi ngày.',226),(1119,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,2,'Liên hệ, đôn đốc các đơn vị vận tải vào nhận hàng tại Công ty đúng lịch.',226),(1120,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,3,'Phối hợp với các bộ phận, phòng ban khác trong việc điều xe để đảm bảo tiến độ ngay cả khi cao điểm hàng hóa ở Công ty.',226),(1121,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,4,'Xử lý được các tình huống phát sinh khi xe không vào nhận hàng đúng theo lịch hoặc khi xe có sự cố.',226),(1122,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,5,'Kiến tạo các giải pháp cho cấp trên nhằm cải tiến chất lượng giao nhận hàng tại Công ty.',226),(1123,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,1,'Biết/trình bày được các nội dung của hợp đồng cần giám sát',227),(1124,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,2,'Thực hiện việc giám sát hợp đồng thường xuyên nhằm đảm bảo việc thực hiện hợp đồng đúng nội dung và tiến độ.',227),(1125,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,3,'Thực hiện giám sát hợp đồng, phát hiện được các nội dung chưa phù hợp và chưa đúng tiến độ.',227),(1126,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,4,'Giải quyết các vấn đề trục trặc hoặc sai lệch khi thực hiện hợp đồng.',227),(1127,'2020-02-05 07:16:51',NULL,0,NULL,NULL,0,5,'Thiết lập quy trình hướng dẫn việc giám sát hợp đồng, các điểm rủi ro, điể