vị trí của dây chuyền sản xuất.',351),(1745,'2020-02-05 13:55:24',NULL,0,NULL,NULL,0,3,'Xác định số lượng lao động phù hợp trên dây chuyền sản xuất.',351),(1746,'2020-02-05 13:55:24',NULL,0,NULL,NULL,0,4,'Xác định thời gian thực hiện trên dây chuyền cho mỗi loại sản phẩm.',351),(1747,'2020-02-05 13:55:24',NULL,0,NULL,NULL,0,5,'Đưa ra các quy trình hướng dẫn, bố trí lao động trên dây chuyền.',351),(1748,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'Biết được danh mục các quy trình ISO 9001: 2015\n- Biết danh mục quy trình phòng Hành chánh đang thực hiện\n- Biết số lần đánh giá ISO nội bộ/ năm',352),(1749,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'- Hiểu được từng phòng ban đang thực hiện theo những QT nào\n- Hiểu được các bước công việc khi tham gia đánh giá ISO nội bộ\n- Hiểu được nội dung từng QT của ISO 9001: 2015',352),(1750,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'- Tham gia kiểm tra đánh giá ISO nội bộ\n- Phát hiện các lỗi chưa phù hợp 1 cách chính xác\n- phụ trách ISO của phòng: cập nhật hồ sơ, tiếp đoàn đánh giá',352),(1751,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'- Phân loại các cấp độ của sự không phù hợp, lỗi O, m và M\n- Chỉ ra được nhưng điểm chưa phù hợp Đơn vị đang thực hiện so điểm nào đã được hướng dẫn trong quy trình ISO\n- tham gia làm Trưởng đoàn đánh giá',352),(1752,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'- Soạn thảo Quy trình mới, hướng dẫn Các quy trình ISO cho cấp dưới\n- Xây dựng các giải pháp khắc phục điểm không phù hợp\n- Tổ chức biên soạn lại các quy trình lỗi thời, không phù hợp với tình hình mới của Công ty.',352),(1753,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'- Biết bộ hồ sơ đầy đủ gồm những gì\n- Biết hồ sơ gồm những cá nhân, bộ phận có thẩm quyền phê duyệt.\n- Biết bản gốc, bản copy chuyển cho bộ phần nào và mình lưu hồ sơ gì',353),(1754,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'- Hiểu được tính liên kết trong 1 bộ hồ sơ đầy đủ\n- Hiểu nội dung của bộ hồ sơ\n- Hiểu quy trình luân chuyển chứng từ',353),(1755,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'- Lập hồ sơ đúng yêu cầu về nội dung và hình thức văn bản\n- Chuyển hồ sơ bản gốc, bản photo đầy đủ cho bộ phân liên quan đầy đủ\n- Sắp xếp, phân loại hồ sơ theo thứ tự phát sinh gọn gàng, ngăn nắp dễ tìm khi cần truy xuất.',353),(1756,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,' - Phân loại danh mục các loại hồ sơ, ai đang phụ trách lưu giữ, đang để ở file nào trong tủ nào\n- Vận dụng tốt các quy chế, quy định trong quá trình lập và lưu giữ hồ sơ',353),(1757,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'Soạn lập hoàn chỉnh các hồ sơ liên quan, quy trình thực hiện một bộ hồ sơ từ lúc lên kế hoạch đến khi phê duyệt thanh toán và lưu hồ sơ.\n- Tổ chức hệ thống báo cáo kiểm tra định kỳ',353),(1758,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,' - Biết trang thiết bị cần thiết cho nhà ăn\n- Biết công viêc của từng nhân viên bếp ăn\n- biết thực đơn và định lượng món ăn',354),(1759,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,' - Hiểu được thực đơn thường nấu tại Bếp ăn công ty\n- Hiểu cánh tính định lượng món ăn\n- Hiểu từng bước thực hiện tổng kết số lương suất ăn, báo số suất và đ1ng phiếu cơm',354),(1760,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'- Kiểm tra, giám sát lựa chọn thực đơn và định lượng món ăn\n- Báo chính xác số lượng suất ăn và phiếu ăn cho từng ca kíp\n- Kịp thời đề nghị thay thế, sửa chữa trang thiết bị nhà ăn\n- Nhắc nhỡ giám sát nhân viên bếp ăn',354),(1761,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'\"- Chủ động xử lý các phát sinh ngoài kế hoạch,  không xảy ra sự cố về an toàn thực phẩm\n- Thương lương tỷ lệ mua thực phẩm và % chi phí quản lý của nhà thầu\n- Đề xuất tổ chức suất ăn tươi, lên thực đơn cao cấp',354),(1762,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'- Xây dựng tiêu chuẩn nhà cung cấp, ban hành các qui định quản lý nhà ăn\n- Phân tích điểm lợi và không có lợi khi Công ty tự tổ chức nấu ăn mà không giao nhà thầu thực hiện\n- Thương lượng với nhà thầu về các điều khoản nội dung thực hiện hợp đồng',354),(1763,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,' Biết được các khu vực do Phòng Hành chánh quản lý\n- Biết nhân viên vệ sinh nào đang phụ trách từng khu vực\n- Biết ca trực của nhân viên vệ sinh\n- Biết lịch đổ rác',355),(1764,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'- Phân công trách nhiệm cụ thể cho từng nhân viên vệ sinh\n- Liên lạc bên DV đến lấy rác\n- Xếp ca trực cho nhân viên vệ sinh',355),(1765,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,' - Kiểm tra, giám sát công tác thực hiện vệ sinh đạt yêu cầu\n- Sắp xếp ca trực hợp lý, không có khiếu nại khiếu kiện\n- Làm việc với đơn vị liên quan khi khu vực phòng hành chánh bị ảnh hưởng (xe đậu lối đi bộ, nhớt chảy ra đường, pallet or vật dụng khác chiếm chỗ)',355),(1766,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'- Phân công công việc hợp lý cho từng nhân viên vệ sinh\n- Tổ chức kiểm tra giám sát, phân loại rác và đổ rác\n- đề xuất thời gian tăng ca hợp lý cho khối lượng công việc phát sinh\n- chủ động tổ chức thực hiện vệ sinh trước khi có đoàn đến tham quan hay kiểm tra',355),(1767,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'- Xây dựng kế hoạch triển khai công tác vệ sinh và kiểm tra kết quả\n- Giải quyết công việc phát sinh trong nhóm\n- Phân tích hiệu quả công việc tăng ca của nhóm vệ sinh\n- Phân tích khối lượng công việc và thời gian hoàn thành để quyết định làm trong giờ hay tăng ca cho việc phát sinh ngoài kế hoạch',355),(1768,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'Biết được các bệnh tổng quát ( nhóm hạ sốt-giảm đau, kháng sinh, kháng viêm, dạ dày ruột, tim mạch huyết áp, da liểu…).',356),(1769,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'Hiểu được các triệu chứng của bệnh tổng quát (nhóm hạ sốt-giảm đau, kháng sinh, kháng viêm, dạ dày ruột, tim mạch huyết áp, da liểu…).',356),(1770,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'Chẩn đoán các bệnh ( nhóm hạ sốt-giảm đau, kháng sinh, kháng viêm, dạ dày ruột, tim mạch huyết áp, da liểu…) thông qua thăm hỏi, khám bệnh kết hợp với xét nghiệm cận lâm sàng.',356),(1771,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'Chẩn đoán xác định được bệnh và nắm vững kiến thức dược lý ( nhóm hạ sốt-giảm đau, kháng sinh, kháng viêm, dạ dày ruột, tim mạch huyết áp, da liểu…)  để điều trị bệnh.',356),(1772,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'Ban hành phác đồ điều trị, hướng dẫn công việc khám chữa bệnh ( nhóm hạ sốt-giảm đau, kháng sinh, kháng viêm, dạ dày ruột, tim mạch huyết áp, da liểu…)',356),(1773,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'Biết tên và ký hiệu về các chỉ số về xét nghiệm thông thường',357),(1774,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'- Hiểu được tên và chỉ số xét nghiệm ngoài khung chỉ số thông thường\n- Đọc hiểu kết quả siêu âm, chụp X quang',357),(1775,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'- Tư vấn được cho CB-CNV đến cơ quan y tế điều trị.\n- Tư vấn cho CN CNV về chế độ ăn uống, chăm sóc sức khỏe, luyện tập thể dục…',357),(1776,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'Giải thích được hiện tượng bệnh lý cho CBCNV rằng họ có khả năng đang mắc chứng bệnh gì, cần đến bênh việc nào để thăm khám có kết quả chính xác hơn.',357),(1777,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'- Theo dõi sức khỏe CB CNV đang mắc bệnh nặng\n- Đưa ra được lời khuyên chế độ sinh hoạt, ăn uống, điều trị bệnh.',357),(1778,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'Biết các bước thao tác thực hiện sơ cấp cứu (cầm máu, băng bó vết thương, cố định xương bị gãy)',358),(1779,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'Nhận biết nhanh nơi bị tổn thương trên cơ thể để thực hiện sơ cấp cứu kịp thời (cầm mmáu, cố định xương bị gãy, băng bó vết thương)',358),(1780,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'Thực hiện đúng các thao tác sơ cấp cứu (cầm mmáu, cố định xương bị gãy, băng bó vết thương) để không ảnh hưởng đến sức khỏe bệnh nhân sau này',358),(1781,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'Đánh giá đúng được tình trạng bệnh nhân để quyết định chuyển viện phù hợp',358),(1782,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'- Ban hành các quy trình sơ cấp cứu trong Công ty và đào tạo hướng dẫn\n- Phân loại từng loại tại nạn mà hướng dẫn các bước thực hiện thao tác sơ cấp cứu',358),(1783,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'Cập nhật danh mục về bệnh nghề nghiệp hằng năm (năm 2019 quy định 34 bệnh nghề nghiệp)',359),(1784,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'Nhận diện được các yếu tố độc hại có trong môi trường làm việc của CB-CNV có khả năng liên quan đến bệnh nghề nghiệp nào.',359),(1785,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'Đánh giá mức ảnh hưởng của các yếu tố độc hại đến sức khỏe \nTổ chức đo chức năng hô hấp, đo thính lực\nĐối với công nhân tiếp xúc enzyme thì sau khi có kết quả thổi dung ký, lập báo cáo gửi Unilever',359),(1786,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'Tuyên truyền sự ảnh hưởng của yếu tố độc hại và đưa ra các loại bảo hộ lao động phù hợp để phòng chống các yếu tố trong môi trường làm việc.',359),(1787,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'Đưa ra ý kiến cải tạo môi trường làm việc để hạn chế các yếu tố độc hại làm phát sinh bệnh nghề nghiệp\n',359),(1788,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'Biết các quy định về định mực xăng dầu, bảo trì định kỳ, đăng kiểm, bảo hiểm xe',360),(1789,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'Hiểu được các bước thực hiện điều xe và cung cấp đầy đủ thông tin cho những cá nhân nhiên quan.\nNắm được nội dung hợp đồng vận chuyển hiện đang có tại phòng ',360),(1790,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'Sắp xếp xe công tác hiệu quả, khoa học tiết giảm chi phí\nTheo dõi tình trang của đội xe (đến hạn bảo dưỡng, sữa chữa, mua bao hiểm )\nLập danh sách nhà cung cấp vận chuyển, có đơn giá từng lô trình đã thực hiện để thương lượng giá vận chuyển khi có phát sinh',360),(1791,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'- Đàm phán với nhà cung cấp dịch vụ vận chuyển để ký hợp đồng\n- Lựa chọn đơn vị cung cấp xăng dầu cho xe\n- Lựa chọn đơn vị thực hiện sửa chữa, bảo dưỡng đáng tin cậy, có giá cả hợp lý',360),(1792,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'Soạn thảo các quy định về quản lý đội xe.\nPhân tích chi phí phát sinh của từng xe trong năm và hiệu quả sử dụng của từng xe\n- Thu thập đủ số liệu, cơ sở để đề xuất đầu tư loại xe, hiệu xe phù hợp nhu cầu Công ty\n- Thu thập đủ số liệu, cơ sở để đề xuất thanh lý xe  sử dụng không hiệu quả',360),(1793,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'Biết danh mục tài sản giám sát theo phân công + tình trạng sử dụng',361),(1794,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'Hiểu các bước kiểm tra, đề xuất sửa chữa và nghiệm thu sửa chữa và bảo quản cơ sở chất chất',361),(1795,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'- Giám sát việc sử dụng tài sản, kịp thời ghi nhận các trường hợp tài sản bị hư hỏng\n- Theo dõi đôn đốc việc sửa chữa CSVC kịp thời\n- Hướng dẫn, Phân công hợp lý cho nhân viên sửa chữa thực hiện',361),(1796,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'- Kiểm soát chi phí, thời gian sửa chữa, bảo hành trong ngân sách được phê duyệt\n- Thống kê chi phí sửa chữa CSVC trong năm',361),(1797,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'- Xây dựng kế hoạch bảo trì, sửa chữa, thay thế, mua mới hàng năm\n- Phân tích hiệu quả sử dụng từng lọai Trang thiết bị or từng khu vực\n- Soạn thảo các quy định, hướng dẫn công tác thực hiện sửa chữa CSVC nhỏ đo Phòng tự thực hiện',361),(1798,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'Liệt kê được các bước công việc khi tiến hành sửa chữa/ thay thế thiết bị nhỏ Cơ sở vật chất do phòng quản lý',362),(1799,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'Sắp xếp được các bước công việc khi tiến hành sửa chữa/ thay thế thiết bị nhỏ Cơ sở vật chất do phòng quản lý',362),(1800,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'Thực hiện đúng các trình tự công việc sửa chữa/thay thế, lắp đặt các thiết bị nhỏ cơ sở vậyt chất do phòng quản lý',362),(1801,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'Chủ động tìm kiếm các hư hỏng và đề xuất các biện pháp sửa chữa hoặc thay thế với cấp quản lý',362),(1802,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'Đánh giá hiệu quả kinh tế khi quyết định sửa chữa hay thay mới cho thiết bị đang bị hư hỏng hoặc không hiệu quả',362),(1803,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'Biết các quy định về cấp phát BHLĐ, vật dụng văn phòng',363),(1804,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'Tổng hợp nhu cầu/ đề nghị từ phòng ban về việc mua sắm BHLĐ, vật dụng văn phòng',363),(1805,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'- Phân loại nhóm hàng mua và xuất kho là BHLĐ, VPP, HCQT\n- Mua đúng nhu cầu, cấp phát đúng theo tiêu chuẩn, tổng hợp chi phí theo phòng ban',363),(1806,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'Tổng hợp, Thống kê số lương cấp phát thực tế với tiêu chuẩn BHLĐ được duyệt\n- Tổng hợp chi phí thực tế phát sinh với kế hoạch ngân sách được phê duyệt\n- Khảo sát mức độ hài lòng của CB CNV về chất lượng, mẫu mã, sự thoải mái khi sử dụng đối với BHLĐ, vật dụng hành chánh cấp phát',363),(1807,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'- Ban hành định mức sử dụng, quy trình cấp phát, hướng dẫn công việc\n- Xử lý khắc phục các điểm chưa phù hợp theo kết quả của phiếu khảo sát\n- Phân tích lựa chọn đồ BHLĐ phù hợp đảm bảo tốt cho sức khỏe người lao động',363),(1808,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'Biết các quy định về thủ tục thanh toán của Công ty',364),(1809,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'Hiểu được các bước thu thập hồ sơ chứng từ, làm đề nghị thanh toán các quy trình luân chuyển chứng từ trình ký.',364),(1810,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'- Thu thập đầy đủ hồ sơ chứng từ theo quy định\n- Lập đề nghị thanh toán chi phí trong phòng chính xác\n- Trình ký, chuyển chứng từ cho bộ phân liên quan\n- Phân loại, lưu giữ chứng từ khoa học, dễ tìm, dễ lấy và dễ truy xuất.',364),(1811,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'- Kiểm tra sự hợp lệ, đầy đủ của hồ sơ chứng từ thanh toán\n- Thống kê, phân loại từng loại chi phí trong phòng\n- Kiểm soát chi phí phát sinh thực tế so với kế hoạch được duyệt',364),(1812,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'- Soạn lập hướng dẫn công việc quản lý chi phí, hướng dẫn công việc làm hồ sơ thanh toán\n- Lập kế hoạch chi phí hằng năm cho phòng\n- Thống kê, phân tích  chi phí phát sinh ngoài kế hoạch\n- Phân tích mức độ lạm phát chung và tình hình tăng chi phí tại phòng',364),(1813,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'Biết các quy định về tiếp khách, khánh tiết của Công ty',365),(1814,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'Hiểu được các bước thực hiện đón tiếp khách và chuẩn bị phòng họp',365),(1815,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'Tiếp đón khách theo đúng hướng dẫn, kịp thời, chuẩn bị đủ đồ dùng tiếp khách',365),(1816,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'Xử lý các trường hợp phát sinh ngoài kế hoạch hợp lý, linh hoạt, hài lòng khách hàng',365),(1817,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'Ban hành các quy định về lễ tân, khánh tiết, hướng dẫn công việc\n- Phân tích kết quả đánh giá mức độ hài lòng của CB CNV về công tác đón tiếp khách. Đề ra cách giải quyết khắc phục.',365),(1818,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'Biết sử dụng điện thoại tổng đài, số nội bộ ',366),(1819,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'Tiếp nhận và chuyển cuộc gọi',366),(1820,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,3,'Giao tiếp phù hợp với người gọi, biết từ chối cuộc gọi một cách lịch sự',366),(1821,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,4,'- Sắp xếp cuộc hẹn cho Ban lãnh đạo\n- Tổ chức thu âm, cài đặt tổng đài trả lời tự động',366),(1822,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,5,'Ban hành quy định, hướng dẫn công việc trực tổng đài\n- Phân tích kết quả đánh giá mức độ hài lòng của CB CNV đối công tác trực tổng đài. Đề ra cách giải quyết khắc phục.',366),(1823,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,1,'Biết quy định về sử dụng, bảo quản con dấu của Công ty',367),(1824,'2020-02-05 19:35:37',NULL,0,NULL,NULL,0,2,'- Biết các trường hợp cần sử dụng con dấu\n- Biết chữ ký và tên người có thẫm quyề