 và cấp bậc của vị trí \n- Hoàn tất được việc xây dựng mô tả công việc cho một chức danh cụ thể \n- Thiết lập được yêu cầu năng lực cho mỗi vị trí ',379),(1886,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,4,'Phân tích được ưu điểm và nhược điểm của các mô hình cơ cấu tổ chức và vị trí công việc \n- Phân biệt được các phương pháp xây dựng hệ thống chức danh và cấp bậc của vị trí \n- Phân tích những hạn chế, thiếu sót đối với mỗi mô tả công việc\n- Có khả năng đào tạo đội ngũ quản lý cấp trung và thuyết phục quản lý cấp cao trong việc xây dựng cơ cấu tổ chức phù hợp với định hướng chiến lược và kế hoạch SXKD',379),(1887,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,5,'Linh hoạt trong việc điều chỉnh cơ cấu và vị trí nhằm đáp ứng yêu cầu sản xuất kinh doanh và năng lực đội ngũ, tăng cường hiệu suất làm việc',379),(1888,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,1,' Có thể trình bày về khái niệm và vai trò của văn hóa doanh nghiệp',380),(1889,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,2,'Hiểu được vai trò và các phương pháp xây dựng văn hóa doanh nghiệp. \n\n- Hiểu được các phương pháp phổ biến, truyền đạt và giám sát thực hiện VHDN tại công ty ',380),(1890,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,3,'Triển khai được các nội dung liên quan đến văn hóa doanh nghiệp bao gồm: Tầm nhìn - sứ mệnh, giá trị cốt lõi, bộ nguyên tắc ứng xử… \n\n- Tổ chức triển khai các chương trình VHDN tại Công ty theo kế hoạch \n- Đạt kết quả tốt trong phổ biến, truyền đạt và giám sát thực hiện VHDN tại công ty',380),(1891,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,4,'Khả năng xây dựng chính sách, qui chế nhằm phát triển VHDN đạt kết quả tốt \n- Có khả năng tổ chức thực hiện thành công các chương trình hoạt động nhằm củng cố và phát triển VHDN\n- Có khả năng phân tích đánh giá thực trạng đồng thời khởi xướng và đề xuất các chương trình hoạt động giúp thực hiện VHDN hiệu quả',380),(1892,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,5,'Có khả năng tổ chức thực hiện thành công các chương trình hoạt động nhằm tạo sự gắ