 số trên.\n- Sử dụng các công cụ cắt, tách, ghép layer trong photoshop.',382),(1900,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,3,'- Sử dụng được các công cụ (Tool) trong photoshop và Ai để thiết kế banner, poster, logo, standee.\n- Làm được ảnh thẻ chân dung\n- Cắt, ghép, xóa vật thể hình ảnh sự kiện, phong cảnh.\n- Blend màu cho hình ảnh',382),(1901,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,4,'-Thiết kế tạp chí, photobook, quảng cáo.\n- Chỉnh hình nghệ thuật, phục hồi ảnh cũ.\n- Sử dụng phần mềm Ai để vẽ đồ họa.\n- Bình luận, phân tích những lỗi sai và cách khắc phục trong sản phẩm thiết kế',382),(1902,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,5,'- Chỉnh sửa, phê duyệt các bản thiết kế.\n- Hướng dẫn và đào tạo cho người khác về kỹ năng thiết kế',382),(1903,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,1,'- Liệt kê được các định dạng video phổ biến\n- Biết được một số phần mềm dựng phim.',383),(1904,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,2,'- Hiểu được các khu vực làm việc trên giao diện của phần mềm dựng phim Pr.\n- Sử dụng phần mềm Pr để cắt, nối một video. Biết cách render video ở chế độ Custom.',383),(1905,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,3,'- Khai thác được các tính năng trên thanh timeline, hiệu ứng effects. \n- Dựng được phóng sự, MV ca nhạc, phim.',383),(1906,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,4,'- Sử dụng được phần mềm Af để tạo ra những đoạn video intro hoặc hiệu ứng đồ họa.\n- Kết hợp nhiều phần mềm đồ họa để dựng video quảng cáo.',383),(1907,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,5,'- Đưa ra kịch bản và tổ chức công việc dựng phim.\n- Hướng dẫn, đào tạo người khác về kỹ năng biên tập video.',383),(1908,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,1,'- Liệt kê được các kênh truyền thông nội phổ biến như: Bảng tin, Tivi công cộng, website, mạng xã hội…\n- Mô tả sơ bộ được cách vận hành một kênh truyền thông.',384),(1909,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,2,'- Làm rõ được vai trò của các kênh truyền thông\n- Phân loại được thông tin, sắp xếp đăng tin phù hợp cho từng kênh truyền thông.',384),(1910,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,3,'- Vận hành các kênh truyền thông hoạt động hiệu quả.\n- Lập kế hoạch đăng tin cho các kênh truyền thông.\n- Đánh giá mức độ hiệu quả của các kênh truyền thông.',384),(1911,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,4,'- Khảo sát mức độ hiểu quả của các kênh truyền thông.\n- Phân tích được ưu, nhược điểm của các kênh và cách khắc phục.\n- So sánh, đánh giá xu hướng phát triển của các kênh truyền thông.\n- Đề xuất ý tưởng, giải pháp để phát triển hệ thống các kênh truyền thông.',384),(1912,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,5,'- Thiết kế và tổ chức vận hành hệ thống kênh truyền thông.\n- Tư vấn phát triển các kênh truyền thông.',384),(1913,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,1,'Biết được bố cục cơ bản của một bài viết\nBiết được hình thức trình bày các dạng bài viết ở mức tổng quan',385),(1914,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,2,'- Phân loại được các dạng bài viết\n- Nhận định được các bước để xây dựng một bài viết.\n- Bài viết truyền đạt được nội dung cần thiết đến người đọc.',385),(1915,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,3,'- Bài viết trình bày rõ ràng, mạch lạc, đúng ngữ pháp.\n- Tạo được điểm nhấn trong bài viết đối với từng thể loại, thu hút được người đọc.\n- Kết hợp bài viết và hình ảnh để tạo thêm sự phong phú cho bài viết.\n- Xác định được văn phong phù hợp với từng thể loại bài viết',385),(1916,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,4,'- Phát hiện lỗi sai trong bài viết và đưa ra giải pháp khắc phục.\n- Phân tích sự sáng tạo trong từng bài viết.\n- Đưa ra được các nội dung sáng tạo phù hợp với từng thể loại bài viết. \n',385),(1917,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,5,'- Thẩm định mức độ phù hợp của bài viết, chỉnh sữa bài viết.\n- Phê duyệt bài viết.\n- Xây dựng được cấu trúc bài viết phù hợp với nội dung truyền thông',385),(1918,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,1,'- Liệt kê được các loại hình sự kiện phổ biến\n- Mô tả được các bước để tổ chức một sự kiện',386),(1919,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,2,'- Phân biệt được \"Chương trình\" và \"Sự kiện\"\n- Thể hiện được vai trò của việc tổ chức sự kiện.\n- Làm rõ được quy trình để tổ chức một sự kiện.',386),(1920,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,3,'- Lên ý tưởng , nội dung, viết kịch bản và lập kế hoạch chi tiết cho sự kiện.\n- Triển khai tổ chức thực hiện theo kế hoạch.\n- Đề xuất các ý tưởng, chương trình, sự kiện nhằm gắn kết các CB-CNV.',386),(1921,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,4,'- Khảo sát mức độ hài lòng về sự kiện\n- Phân tích đánh giá mức độ hiệu quả của sự kiện\n- Kiểm soát được các rủi ro trong quá trình diễn ra sự kiện. Đưa ra được giải pháp khắc phục khi có sự cố.',386),(1922,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,5,'- Thiết kế, dàn dựng triển khai tổ chức các sự kiện lớn.\n- Xây dựng, điều phối các chương trính sự kiện quan trọng ',386),(1923,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,1,'Biết được sơ lược các khái niệm, nguyên tắc liên quan đến nhận dạng, thu hút, chọn lựa và bố trí, sắp xếp cá nhân vào vị trí phù hợp (bao gồm giao việc, bổ nhiệm và miễn nhiệm) \n- Mô tả được sơ lược các qui trình liên quan đến nhận dạng, thu hút, chọn lựa và bố trí, sắp xếp cá nhân vào vị trí phù hợp  (bao gồm giao việc, bổ nhiệm và miễn nhiệm) \n- Chưa đề xuất được các phương án nhằm thu hút, lựa chọn/bổ nhiệm và bố trí, sắp xếp cá nhân vào vị trí phù hợp',387),(1924,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,2,'Giải thích được các khái niệm, nguyên tắc liên quan đến nhận dạng, thu hút, chọn lựa và bố trí, sắp xếp cá nhân vào vị trí phù hợp  (bao gồm giao việc, bổ nhiệm và miễn nhiệm)\n- Giải thích được các qui trình liên quan đến nhận dạng, thu hút, chọn lựa và bố trí, sắp xếp cá nhân vào vị trí phù hợp  (bao gồm giao việc, bổ nhiệm và miễn nhiệm)\n- Đề xuất các phương án nhằm thu hút, lựa chọn/bổ nhiệm và bố trí, sắp xếp cá nhân vào vị trí phù hợp nhưng cần chỉnh sửa, bổ sung để có thể sử dụng\n- Thực hiện các thủ tục theo quy định về công tác cán bộ, bao gồm xây dựng tiêu chuẩn, quy hoạch, bố trí sử dụng, bổ nhiệm, miễm nhiệm, luân chuyển, cần sự chỉ dẫn cụ thể để hoàn thành tốt công việc',387),(1925,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,3,'Thực hiện hiệu quả các thủ tục theo quy định về công tác cán bộ, bao gồm  xây dựng tiêu chuẩn, quy hoạch, bố trí sử dụng, bổ nhiệm, miễm nhiệm, luân chuyển \n- Đưa ra nhận xét, đánh giá cụ thể về năng lực, sở trường và phẩm chất đạo đức của cán bộ đề xuất bổ nhiệm, miễn nhiệm\n- Quản lý hồ sơ cán bộ đảm bảo cập nhật, khoa học, bảo mật',387),(1926,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,4,'Khả năng xây dựng chính sách và kế hoạch tuyển dụng, bố trí sử dụng nhân sự nhằm đạt mục tiêu chiến lược',387),(1927,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,5,'Khả năng hướng dân, kèm cặp người khác thực hiện hiệu quả các thủ tục theo quy định về công tác lựa chọn và sắp xếp, luân chuyển cán bộ',387),(1928,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,1,'Biết về các nguyên tắc, thủ tục và quy trình phỏng vấn ứng viên và nhân viên \n- Chưa có kinh nghiệm và khả năng vận dụng các kỹ năng phỏng vấn ',388),(1929,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,2,'Giải thích được các nguyên tắc, thủ tục và quy trình phỏng vấn ứng viên và nhân viên \n- Hiểu cách vận dụng các kỹ năng phỏng vấn nhưng chưa linh hoạt để đạt được mục tiêu đề ra \n- Khả năng nhìn nhận và đánh giá ứng viên/nhân viên chưa cao, chưa đưa ra được quyết định phù hợp\n- Khả năng đàm phán còn hạn chế',388),(1930,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,3,'Có kinh nghiệm và vận dụng các kỹ năng phỏng vấn linh hoạt nhằm đạt được mục tiêu đề ra\n- Khả năng nhìn nhận và đánh giá ứng viên thông qua quan sát hành vi, thái độ, đưa ra các quyết định phù hợp\n- Tạo được ấn tượng tốt đối với ứng viên về hình ảnh của công ty\n-  Lựa chọn được ứng viên (cấp độ nhân viên) phù hợp cho tổ chức',388),(1931,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,4,'Lựa chọn được ứng viên (cấp độ quản lý cấp trung) phù hợp cho tổ chức',388),(1932,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,5,'Xây dựng được bộ câu hỏi phỏng vấn, tiêu chí đánh giá phỏng vấn và bảng chấm điểm phỏng vấn cho các vị trí\n- Giúp người khác nâng cao kỹ năng phỏng vấn hiệu quả',388),(1933,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,1,'Biết về những nguyên tắc và phương pháp giảng dạy và đào tạo\n-  Chưa xác định chính xác nhu cầu đào tạo trong Công ty\n- Không có khả năng thiết kế các chương trình đào tạo theo yêu cầu\n- Chưa có khả năng điều phối, vận hành hệ thống đào tạo và các hoạt động huấn luyện đào tạo cho Công ty ',389),(1934,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,2,'Hiểu ở mức cơ bản về những nguyên tắc và phương pháp giảng dạy và đào tạo\n- Xác định được nhu cầu đào tạo trong Công ty\n- Chưa tự thiết kế các chương trình đào tạo một cách độc lập mà vẫn cần sự giám sát và chỉ dẫn của người khác \n- Chưa chủ động điều phối, vận hành hệ thống đào tạo và các hoạt động huấn luyện đào tạo cho Công ty',389),(1935,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,3,'Vận dụng được các nguyên tắc và phương pháp giảng dạy và đào tạo\n- Xác định đúng nhu cầu đào tạo trong Công ty\n- Có khả năng thiết kế các chương trình đào tạo cơ bản theo yêu cầu\n- Chủ động điều phối, vận hành hệ thống đào tạo và các hoạt động huấn luyện đào tạo cho Công ty\n- Có khả năng theo dõi, giám sát và đánh giá hiệu quả trước và sau đào tạo',389),(1936,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,4,' Có khả năng thiết kế các chương trình đào tạo mang tính chuyên sâu \n- Đề xuất cải tiến chương trình đào tạo phù hợp \n-  Có khả năng thiết lập hệ thống đào tạo phù hợp với từng chức năng chuyên môn của công ty\n-  Lập kế hoạch đào tạo dài hạn cho nhân viên trong Công ty\n- Lựa chọn được nhưng phương pháp đào tạo tối ưu cho từng đối tượng nhân viên',389),(1937,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,5,'Xây dựng chương trình đào tạo phù hợp với lộ trình phát triển nghề nghiệp cho nhân viên\n- Có khả năng đưa ra những định hướng đào tạo cho chiến lược phát triển nhân lực của công ty\n- Xây dựng và khuyến khích tinh thần \"tự học hỏi\" ở nhân viên trong công ty',389),(1938,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,1,'Biết  về những nguyên tắc và phương pháp thiết kế lộ trình công danh (career roadmap), hoạch định năng lực và nhân sự kế thừa\n- Chưa có khả năng thiết kế và thực hiện các chương trình chính sách phát triển nhân sự ',390),(1939,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,2,'Hiểu ở mức độ tổng quan về những nguyên tắc và phương pháp thiết kế lộ trình công danh (career roadmap), hoạch định năng lực và nhân sự kế thừa\n- Thiết kế và thực hiện các chương trình chính sách phát triển nhân sự đơn giản',390),(1940,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,3,' Nắm vững những nguyên tắc và phương pháp thiết kế lộ trình công danh (career roadmap), hoạch định năng lực và nhân sự kế thừa \n- Thiết kế, thực hiện và đánh giá các chương trình chính sách phát triển nhân sự khá phức tạp\n-  Đề xuất cải tiến các phương pháp và chương trình phát triển nguồn nhân lực\n- Vận dụng thành thạo những nguyên tắc và phương pháp thiết kế lộ trình công danh (career roadmap), hoạch định năng lực và nhân sự kế thừa',390),(1941,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,4,'Có khả năng tư vấn cho các cấp quản lý áp dụng thành công lộ trình phát triển công danh cho nhân viên\n- So sánh được các phương pháp triển khai xây dựng lộ trình phát triển công danh cho từng cấp bậc của nhân viên',390),(1942,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,5,'Nghiên cứu thị trường lao động và xu hướng phát triển của thị trường lao động nhằm đưa ra các chính sách và chiến lược  phát triển nhân sự phù hợp\n- Áp dụng thành công lộ trình phát triển công danh cho nhân viên trong hệ thống\n- Khả năng huấn luyện người khác làm tốt công tác phát triển nguồn nhân lực',390),(1943,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,1,'- Định nghĩa được khái niệm BSC và KPI.\n- Biết cách đặt mục tiêu theo nguyên tắc smart.\n- Kiến thức hạn chế về thiết kế và phát triển hệ thống và quy định đánh