 giải pháp xếp dỡ hàng hóa một cách tối ưu nhất. ',524),(2612,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'- Đánh giá mức độ hiệu quả quy trình xếp dỡ hàng hóa.\n- Tư vấn, thiết kế và đưa ra các giải pháp nhằm nâng cao hiệu quả của quy trình xếp dỡ hàng háo.',524),(2613,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'- Biết được biểu mẫu nhận dạng hàng hóa\n- Biết được danh mục hàng hóa cần nhận dạng.',525),(2614,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'- Làm rõ được quy trình nhận dạng hàng hóa.\n- Phân biệt được các dạng hàng hóa theo theo thông số, tiêu chuẩn.',525),(2615,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'- Nhận dạng đúng được tất cả các loại hàng hóa.\n- Hoàn thành được bảng nhận dạng hàng hóa.',525),(2616,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'- Xác định các rủi ro trong quá trình nhận dạng hàng hóa.\n- Đưa ra giải pháp để khắc phục các rủi ro trong quá trình nhận dạng hàng hóa.',525),(2617,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'- Đưa ra quy trình chuẩn về nhận dạng hàng hóa.\n- Cập nhật, cải thiện quy trình nhận dạng hàng hóa.',525),(2618,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'- Biết được các mặt hàng hóa trong đơn hàng\n- Biết được các thông tin liên quan đến đơn hàng',526),(2619,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'- Hiểu được cách kiểm tra tồn kho hàng hóa trong đơn hàng\n- Hiểu được việc xử lý đơn hàng nhưng cần sự hỗ trợ',526),(2620,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'- Xử lý được đơn hàng \n- Giao hàng đúng tiến độ yêu cầu\n- Tiếp nhận và xử lý thông tin đơn hàng theo đúng quy trình \n- Xử lý được các vấn đề phát sinh trong phạm vi cơ bản theo quy trình hoặc có sự hỗ trợ từ cấp trên\n',526),(2621,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'Xác định các rủi ro, sai sót trong quá trình tiếp nhận và xử lý thông tin đơn hàng\nCó khả năng chủ động xử lý các vấn đề phát sinh liên quan đến hoạt động của đơn hàng\nĐiều chỉnh, cập nhật quy trình quản lý đơn hàng ở phạm vi cơ bản',526),(2622,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,' Đào tạo, hướng dẫn nghiệp vụ của hoạt động quản lý đơn hàng \nXây dựng quy trình, quy định kiểm soát hoạt động quản lý đơn hàng\nĐiều chỉnh, cập nhật quy trình quản lý đơn hàng toàn hệ thống',526),(2623,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'- Biết về việc phân chia hàng hóa theo trọng tải xe.\n- Biết về bố trí xe đi theo lộ trình giao hàng phù hợp.',527),(2624,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'- Nắm rõ trọng tải xe và lộ trình cần di chuyển\n- Bố trí, sắp xếp hàng hóa cho các xe theo đúng trọng tải.',527),(2625,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'- Tính toán được lộ trình giao hàng thuận tiện và tiết kiệm chi phí nhất.\n- Sắp xếp, bố trí xe giao hàng đầy đủ & đúng thời hạn theo yêu cầu của khách hàng.',527),(2626,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'- Kiểm soát được toàn bộ quá trình điều phối xe.\n- Lý giải được nguyên nhân và đưa ra giải pháp khắc phục sự cố trong quá trình điều phối xe.',527),(2627,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,' Đào tạo, hướng dẫn nghiệp vụ của hoạt động điều phối xe\nXây dựng quy trình, quy định kiểm soát hoạt động điều phối xe',527),(2628,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'- Biết được các mặt hàng\n- Biết cách kiểm đếm hàng hóa\n- Biết so sánh chứng từ với thực tế',528),(2629,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'- Đọc hiểu các loại chứng từ về xuất/nhận hàng hóa.\n- Hiểu được việc phân chia giao nhận hàng hóa',528),(2630,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'- Thực hiện giao hàng đúng chủng loại, đúng người nhận và đúng theo thời gian yêu cầu của đơn hàng.',528),(2631,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'- Kiểm soát được toàn bộ quá trình giao nhận hàng hóa\n- Lý giải được nguyên nhân và đưa ra giải pháp khắc phục sự cố trong quá trình giao nhận hàng hóa.',528),(2632,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'- Phân tích việc giao nhận hàng hóa hiệu quả\n- Thiết lập quy trình giao nhận hàng hóa.',528),(2633,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'- Biết được danh mục hàng hóa cần lưu trữ.\n- Biết được nguyên tắc sắp xếp hàng hóa trong kho.',529),(2634,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'- Giải thích được quy trình sắp xếp hàng hóa trong theo quy định.\n- Phận chia được các khu vực lưu trữ hàng hóa trong kho.\n- Phân loại được các nhóm hàng hóa để sắp xếp. ',529),(2635,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'- Thực hiện công tác sắp xếp hàng hóa theo đúng chủng loại, quy cách, vị trí quy định thuận tiện trong việc nhập xuất hàng hóa.\n- Đảm bảo hàng hóa được bảo quản tốt không xảy ra tình trạng hư hỏng do quá trình sắp xếp bảo quản.',529),(2636,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'- Tính toán được sức chứa của kho nhằm đưa ra giải pháp sắp xếp, lưu trũ hàng hóa phù hợp tiết kiệm không gian.\n- Xác định được các rủi ro có thể xảy ra trong quá trình sắp xếp, bảo quản, lưu trũ hàng hóa.',529),(2637,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'- Thiết kế, xây dựng quy trình liên quan đến việc sắp xếp, bảo quản, lưu trữ hàng hóa.',529),(2638,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'- Biết được các bước kiểm tra xe và các biểu mẫu liên quan.',530),(2639,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'- Hiểu được các thông số kỹ thuật cơ bản về xe\n- Hiểu biết về các thiết bị xe\n- Hiểu cách vận hành xe',530),(2640,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'Theo dõi, đơn đốc việc thực hiện kiểm tra xe đầy đủ:\n- Lập bảng theo dõi việc kiểm tra.\n- Kiểm tra việc thực hiện của nhà thầu, nhà thầu phụ.\n- Lên kế hoạch kiểm tra đột xuất và định kỳ đối với các phương tiện lưu hành. ',530),(2641,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'- Lập kế hoạch bảo trì xe\n- Lập danh mục phương tiện, thiết bị.\n- Lập kế hoạch sửa chữa vào bảo dưỡng xe.\n- Tổng hợp và đánh giá hiệu quả sử dụng của phương tiện, thiết bị.\n- Đưa ra ý kiến xây dựng hoàn thiện quy trình.',530),(2642,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'- Viết các HDCV, quy Trình kiểm tra xe.\n- Xây dựng quy Trình quản lý phương tiện, thiết bị và nhà thầu.\n- Phân tích, đánh giá rủi ro và đưa phương án phòng ngừa các hoạt động của phương tiện, thiết bị và nhà thầu.',530),(2643,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'- Biết được công việc của nhà thầu theo hợp đồng.\n- Biết được tiêu chuẩn để lựa chọn nhà thầu phụ.',531),(2644,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'- Hiểu rõ công việc nhà thầu cần thực hiện theo hợp đồng.\n- Sắp xếp công việc cho nhà thầu theo quy định.',531),(2645,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'- Theo dõi, kiểm tra việc thực hiện công việc của nhà thầu.\n- Tổng hợp chi phí, báo cáo kết quả thực hiện.',531),(2646,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'- Lập kế hoạch thuê nhà thầu phụ.\n- Đánh giá mức dộ hiệu quả của nhà thầu. Đưa ra giải pháp lựa chọn nhà thầu tối ưu, chi phí phù hợp.\n- Giải quyết được các vấn đề phát sinh trong quá trình quản lý nhà thầu phụ.',531),(2647,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'- Đào tạo, hướng dẫn nghiệp vụ liên quan đến quản lý nhà thầu phụ\n- Xây dựng quy trình, hướng dẫn công việc trong quản lý nhà thầu phụ.',531),(2648,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'- Định nghĩa được thế nào là chiến lược, kế hoạch.\n- Biết được các nội dung cơ bản liên quan đến việc lập chiến lược hoạt động của phòng',532),(2649,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'- Làm rõ các bước để xây dựng một chiến lược, kế hoạch về mảng kho vận.\n- Hiểu được các chỉ tiêu, số liệu báo cáo trong quá trình xây dựng chiến lược hoạt động của phòng',532),(2650,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'- Xây dựng được các chỉ tiêu quan trọng trong việc lập kế hoạch và xây dựng chiến lược kho vận của phòng',532),(2651,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'Xây dựng được chiến lược về mảng kho vận gắn liền với mục tiêu công ty.',532),(2652,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'-Tư vấn về việc xây dựng kế hoạch, chiến lược về mảng kho vận.\n- Triển khai, tổ chức thực hiện chiến lược.',532),(2653,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'Biết được các hoạt động, nghiệp vụ xuất nhập hàng của phòng Kho vận\n',533),(2654,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'Dự báo tiến độ nhập xuất hàng hoá theo mục tiêu kinh doanh của công ty',533),(2655,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'Thực hiện kiểm soát hoạt động nhập xuất hàng hiệu quả\nBáo cáo số liệu nhập hàng, xuất hàng nhanh chóng và chính xác',533),(2656,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'Phân tích rủi ro, sai sót trong quá trình kiểm soát hoạt động nhập xuất hàng',533),(2657,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'Tư vấn, điều chỉnh các quy trình đảm bảo hoạt động nhập xuất hàng hiệu quả\nĐào tạo, hướng dẫn và xử lý các vấn đề phát sinh liên quan đến hoạt động nhập xuất hàng',533),(2658,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'- Nhận diện được các hồ sơ biểu mẫu giao nhận hàng hóa.\n- Mô tả được quy trình của việc tổ chức giao hàng.',534),(2659,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'- Hiểu được các thông tin trên hồ sơ, chứng từ giao nhận hàng hoá,\n- Nắm rõ năng lực vận chuyển hàng hóa của nhà cung cấp.',534),(2660,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'- Lập được kế hoạch kế giao hàng.\n- Thực hiện kế hoạch giao hàng đảm bảo hàng được giao đúng chủng loại, đối tượng, và thời gian.',534),(2661,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'- Xây dựng Kế hoạch dự phòng. \n- Xử lý được các sự cố xảy ra nằm trong phạm vy thuộc quy trình giao hàng.',534),(2662,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'- Đào tạo, hướng dẫn nghiệp vụ liên quan đến tổ chức giao hàng.\n- Xây dựng quy trình, hướng dẫn công việc tổ chức giao hàng.',534),(2663,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'Biết được các thông tin cần quản lý liên quan đến đội xe vận tải của nhà cung cấp.',535),(2664,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'Sắp xếp lịch và liên hệ các đội xe vào lấy hàng hóa vận chuyển theo đúng kế hoạch.',535),(2665,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'Phối hợp với các bộ phận, phòng ban khác trong việc điều xe để đảm bảo tiến độ giao hàng ngay cả trong giờ cao điểm.',535),(2666,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'- Xử lý được các tình huống phát sinh khi xe không vào nhận hàng đúng theo lịch.\n- Phân tích nguyên nhân và đưa ra giải pháp khắc phục cải thiện.',535),(2667,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'- Xây dựng các quy trình kiểm tra, đánh giá các đơn vị vận chuyển.\n- Đề xuất cải tiến chất lượng giao nhận hàng tại Công ty.',535),(2668,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'Biết được các nội dung cần thiết của một hợp đồng.',536),(2669,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'- Hiểu được các nội dung thể hiện trên hợp đồng.\n- Có khả năng soạn thảo hợp đồng tương tự.',536),(2670,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'- Kiểm tra, đánh giá việc thực hiện hợp đồng của nhà cung cấp.\n- Phát hiện được các lỗi sai phạm của nhà cung cấp trong quá trình thực hiện hợp đồng.',536),(2671,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'- Phân tích rủi ro có thể xảy ra trong quá trình thực hiện hợp đồng.\n- Xử lý các sự cố phát sinh sinh trong quá trình thực hiện hợp đồng.',536),(2672,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'- Lập quy trình hướng dẫn việc giám sát hợp đồng,\n- Tư vấn, đưa ra cách xử lý khi hợp đồng thực hiện không đúng hoặc sai lệch.',536),(2673,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'- Xác định các thông tin và số liệu cần phân tích, tổng hợp.\n- Biết được các phương pháp phân tích, tổng hợp số liệu.',537),(2674,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'- Hiểu được các số liệu trong báo cáo\n- Có khả năng phân tích, tổng hợp số liệu ở mức độ sơ cấp.',537),(2675,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'- Vận dụng phân tích và tổng hợp được các số liệu theo quy định\n- Hoàn thiện được bảng báo cáo tổng hợp.',537),(2676,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'- Phân tích, đánh giá được tính phù hợp của các con số báo cáo.\n- Điều chỉnh được các sót về số liệu trong bảng báo cáo tổng hợp..',537),(2677,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'- Phê duyệt các số liệu báo cáo tổng hợp.\n- Đưa ra các phương pháp phân tích, tổng hợp số liệu hiệu quả, tránh sai sót.',537),(2678,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'Biết về qui tắc FIFO trong lưu chuyển hàng hoá tại kho bãi\nBiết được nguyên tắc hàng hóa lưu trữ trong kho\nBiết được các vấn đề về lưu trữ hàng hóa',538),(2679,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'Hiểu đươc việc thực hiện  xuất FIFO\nHIểu qui tắc FIFO trong xuất nhập hàng hoá\nXác định được các bước sắp xếp và lưu chuyển hàng hóa theo nguyên tắc FIFO',538),(2680,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'Áp dụng FIFO trong lưu chuyển hàng hóa chuẩn xác\nTuân thủ đúng nguyên tắc FIFO trong lưu trữ hàng hóa',538),(2681,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'Xác định các rủi ro, sai sót trong quá trình áp dụng FIFO trong lưu chuyển hàng hóa\nThực hiện các giải pháp nhằm hạn chế rủi ro, sai sót trong lưu chuyển hàng hóa ở phạm vi hạn chế, cần sự định hướng từ cấp trên\nCó thể xử lý các trường hợp lưu chuyển hàng hóa bị sai, không đúng nguyên tắc',538),(2682,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'Hướng dẫn, đào tạo nghiệp vụ liên quan đến sắp xếp, lưu trữ kho hàng\nXây dựng quy trình, nghiệp vụ liên quan đến lưu trữ kho hàng \nĐưa ra những giải pháp cải tiến hoạt động lưu chuyển hàng hóa tại đơn vị',538),(2683,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'- Biết được lịch sử thông tin đặt hàng, giao hàng của P. Kinh doanh qua các năm\n- Biết kế hoạch sản xuất kinh doanh của Công ty',539),(2684,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'Giải thích được việc xây dựng đồ thị biến thiên giữa sản lượng sản xuất so với nhu cầu giao hàng thực tế',539),(2685,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'Kiểm soát được kế hoạch sản xuất dựa trên báo cáo tồn kho và thực tế giao hàng, nhằm đảm bảo có đủ hàng cho kinh doanh.',539),(2686,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'Tính toán được lượng hàng cần sản xuất so với lượng hàng hóa tồn kho để đảm bảo cho kế hoạch kinh doanh của Công ty.',539),(2687,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,' Hướng dẫn, đào tạo kỹ năng cân đối hàng hóa sản xuất với kế hoạch kinh doanh.\n- Xây dựng quy trình hướng dẫn nghiệp vụ liên quan đến việc cân đối hàng hóa sản xuất với kế hoạch kinh doanh.',539),(2688,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,1,'Có kiến thức về tổng thể hoạt động và vai trò của kho bãi trong chuỗi cung ứng hàng hoá',540),(2689,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,2,'Hiểu biết về hoạt động kho bãi\nTham gia điều hành các hoạt động trong kho bãi trong vai trò quản lý',540),(2690,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,3,'Xây dựng được kế hoạch hoạt động kho hàng \nĐáp ứng nhu cầu kinh doanh hiện tại',540),(2691,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,4,'Xây dựng các phương án quản lý nhằm tối ưu hoá năng suất phục vụ kho bãi (qui trình, tiêu chí đánh giá, phương pháp kiểm tra)',540),(2692,'2020-03-24 15:44:24',NULL,0,NULL,NULL,0,5,'- Đưa ra mô hình quản lý của kho hàng trong 05 năm tới và giải pháp thực hiện \n- Đề xuất điều chỉnh/ xem xét vai trò, chức năng, nhiệm vụ của kho hàng trong chuỗi cung ứng trong 05 năm tới',540),(2693,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,1,'Định nghĩa được thế nào là Social Media. Liệt kê được các kênh Social Media phổ biến và hình thức quảng cáo trên các kênh đó.',541),(2694,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,2,'- Làm rõ được quy trình để chạy quảng cáo trên các kênh Social Media.\n- Thiết lập để chạy quảng cáo một cách cơ bản nhất trên các kênh Social Media.',541),(2695,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,3,'- Vận dụng để thiết lập cũng như vận hành và quản lý các chương trình quảng cáo trên các kênh Social Media.\n- Báo cáo kết quả quảng cáo của các kênh Social Media.',541),(2696,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,4,'- Đánh giá mức độ hiệu quả của các kênh Social Media.\n- Phân tích những điểm chưa phù hợp trong việc quản lý các kênh Social Media.\n- Đề xuất giải pháp khắc phục và phát triển các kênh Social Media.',541),(2697,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,5,'Khả năng hướng dẫn và định hướng phát triển kênh theo từng giai đoạn, từng thời điểm và từng kênh.',541),(2698,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,1,'- Định nghĩa được thế nào là Content Marketing.\n- Liệt kê được các hình thức của Content Marketing.',542),(2699,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,2,'- Phân biệt được các loại Content Marketing.\n- Hiểu được nguyên tắc để tạo ra một Content Marketing.\n- Cho ví dụ minh họa về một Content Marketing.',542),(2700,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,3,'- Tạo ra các Content Marketing phù hợp với yêu cầu để đăng tải lên các kênh truyền thông.\n- Xác định được content phù hợp với sản phẩm của công ty và đối tượng khách hàng phù hợp',542),(2701,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,4,'- Nhận định được các lỗi sai thường gặp trong việc tạo ra Content Marketing. Đưa ra các giải pháp khắc phụ.\n- Đánh giá được tính hiệu quả của từng loại Content Marketing. Đưa ra ý tưởng sáng tạo để phát triển Content Marketing.\n- Điều chỉnh content phù hợp với xu hướng người tiêu dùng hoặc định hướng của sản phẩm ',542),(2702,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,5,'Định hướng, xây dựng, phát triển, xem xét và đánh giá nội dung cho từng chiến dịch Marketing.',542),(2703,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,1,'- Trình bày được khái niệm về các thuật ngữ như: SEM, SEO, Paid Search, Google Ads.',543),(2704,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,2,'- Phân biệt được SEM, SEO, Paid Search, Google Ads.\n- Trình bày cách thức hoạt động của SEM (bao gồm SEO và Paid Search) và nêu ra ưu nhược điểm của từng loại.',543),(2705,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,3,'Khả năng chọn lọc từ khóa và tối ưu hóa nội dung (content) theo chuẩn SEO như: \n- Viết tiêu đề hấp dẫn\n- Phân bổ từ khóa hợp lý\n- Sử dụng hình ảnh\n- Đặt liên kết nội bộ và dẩn liên kết bên ngoài',543),(2706,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,4,'- Nhận định được các lỗi sai thường gặp trong việc tạo ra trong nghiệp vụ SEM. Đưa ra các giải pháp khắc phụ.\n- Đánh giá được tính hiệu quả của từng nghiệp vụ.\n- Điều chỉnh nghiệp vụ SEM phù hợp sau các chương trình triển khai',543),(2707,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,5,'Khả năng định hướng và hướng dẫn việc chọn từ khóa, tối ưu hóa content và sử dụng các kỹ thuật SEO.',543),(2708,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,1,'Biết được những số liệu quan trọng liên quan đến hành vi người dùng cần thu thập.',544),(2709,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,2,'- Hiểu được các phương pháp để thu thập số liệu.\n- Phân loại và sắp xếp các số liệu thu thập theo từng tiêu chí cụ thể.\n',544),(2710,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,3,'- Vận dụng các phương pháp để lấy được số liệu theo yêu cầu.\n- Có khả năng tổng hợp và phân tích số liệu để đưa ra được báo cáo liên quan đến hành vi của người dùng.',544),(2711,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,4,'- Phân tích, đánh giá được tính phù hợp của các con số báo cáo.\n- Điều chỉnh được các sót về số liệu trong bảng báo cáo tổng hợp về hành vi người dùng.\n- Đề xuất các giải pháp liên nhằm tối ưu hóa sản phẩm, dịch vụ phù hợp với hành vi của người dùng.',544),(2712,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,5,'Khả năng hướng dẫn và đưa ra quy trình trong việc thu thấp và phân tích hành vi người dùng\nĐịnh hướng những tiêu chí, số liệu thu thập phù hợp với mục tiêu phát triển, kế hoạch, chiến lược của Phòng.',544),(2713,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,1,'- Nhận diện được các kênh truyền thông của đối thủ cạnh tranh.\n- Biết được những thông tin quan trọng cần thu thập của đối thủ.\n- Biết được phương pháp thu thập thông tin',545),(2714,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,2,'- Thể hiện được quy trình về theo dõi và phân tích chiến dịch quảng cáo trên các kênh truyền thông của đối thủ.\n- Biết được các phương pháp để thu thập thông tin.\n- Phân loại và sắp xếp các thông tin thu thập theo từng tiêu chí cụ thể.',545),(2715,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,3,'- Vận dụng các phương pháp để lấy được dữ liệu thông tin cần thiết.\n- Có khả năng tổng hợp và phân tích dữ liệu, đưa ra nhận định về các chiến dịch truyền thông của đối thủ.',545),(2716,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,4,'Phân tích , so sánh đưa ra các giải pháp, kế hoạch về chiến dịch quảng cáo nhằm cạnh tranh với các kênh truyền thông của đối thủ.',545),(2717,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,5,'Hướng dẫn, đưa ra quy trình quy định về việc thu thập thông tin, đánh giá và đưa ra giải pháp đối phó với các chiến dịch truyền thông của đối thủ',545),(2718,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,1,'Biết về lợi ích về việc thiết lập mối quan hệ với giới truyền thông\n- Xác định được nhóm truyền thông cần thiết lập mối quan hệ',546),(2719,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,2,'- Phân loại được các nhóm đối tượng trong giới truyền thông.\n- Nắm rõ được cách thức, quy trình để liên hệ và xây dựng mối quan hệ với giới truyền thông.',546),(2720,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,3,'- Kiến tạo được các mối quan hệ với những cá nhân, tổ chức làm trong giới truyền thông và có thể trao đổi thông tin khi cần thiết.\n- Vận dụng các mối quan hệ với giới truyền thông để hổ trợ trong các chương trình PR, quảng bá sản phẩm.',546),(2721,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,4,'Khả năng duy trì, mở rộng mối quan hệ trong giới truyền thông và tìm kiếm mối quan hệ với các lãnh đạo cấp cao, công ty truyền thông, người nổi tiếng.\n',546),(2722,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,5,'- Nhận định, đánh giá, đưa ra hướng kế hoạch và hướng về việc phát triển mối quan hệ với giới truyền thông.\n- Đào tạo, hướng dẫn nghiệp vụ về thiết lập mối quan hệ với giới truyền thông.',546),(2723,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,1,'- Nhận biết được vai trò của việc nghiên cứu thị trường trong kinh doanh.\n- Biết được các nguyên tắc và phương pháp nghiên cứu thị trường.',547),(2724,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,2,'- Hiểu được các phương pháp thu thập thông tin, phương pháp nghiên cứu định tính trong nghiên cứu thị trường.\n- Xác định được những dữ liệu cần thiết cho việc nghiên cứu thị trường.',547),(2725,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,3,'- Xác định được phương pháp khảo sát, mẫu khảo sát phù hợp với mục đích điều tra nghiên cứu thị trường.\n- Xây dựng được bảng hỏi hợp lý, Thực hiện được các cuộc khảo sát thị trường.\n- Báo cáo tổng hợp kết quả khảo sát',547),(2726,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,4,'- Xây dựng được kế hoạch nghiên cứu thị trường.\n- Xác định được những khó khăn có thể gặp phải trong quá trình thực hiện nghiên cứu thị trường. Đưa ra các giải pháp khắc phục. \n- Phân tích dữ liệu khảo sát, viết báo cáo nghiên cứu thị trường.',547),(2727,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,5,'- Thẩm định, phệ duyệt và triển khai tổ chức các dự án nghiên cứu thị trường.\n- Đào tạo, hướng dẫn nghiệp vụ liên quan đến nghiên cứu thị trường.',547),(2728,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,1,'- Định nghĩa được thế nào là chiến lược, kế hoạch.\n- Biết được các nội dung cơ bản liên quan đến việc lập kế hoạch, chiến lược.',548),(2729,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,2,'- Hiểu quy trình hoạch định và nội dung của kế hoạch marketing.\n- Hiểu rõ tiến trình STP – Phân khúc khách hàng, lựa chọn thị trường mục tiêu và định vị thương hiệu.',548),(2730,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,3,'- Xác định mục tiêu marketing và xây dựng kế hoạch hành động để đạt mục tiêu.\n- Xây dựng chiến lược marketing để tạo ra lợi thế cạnh tranh trên thị trường.',548),(2731,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,4,'- Phân tích chi phí và xác định ngân sách phù hợp với kế hoạch, chiến lược marketing nhằm tối ưu lợi nhuận của doanh nghiệp.\n- Phân tích và đánh giá hiệu quả của kế hoạch marketing.',548),(2732,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,5,'- Thẩm định, phệ duyệt và triển khai tổ chức kế hoạch, chiến lược marketing.\n- Đào tạo, hướng dẫn nghiệp vụ liên quan đến việc lập kế hoạch, chiến lược marketing.',548),(2733,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,1,'- Định nghĩa được thế nào là thương hiệu, các nhân tố cấu thành giá trị thương hiệu.\n- Biết về tầm nhìn, sứ mệnh và giá trị cốt lõi của Thương hiệu.',549),(2734,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,2,'- Hiểu được các phương pháp “Định vị  thương hiệu” và xác định giá trị thương hiệu.\n- Làm rõ được các tiêu chí và kỹ thuật xây dựng hệ thống nhận diện thương hiệu',549),(2735,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,3,'- Thiết kế và xây dựng các thành phần của thương hiệu như: Nhãn hiệu, khẩu hiệu, đoạn nhạc…\n- Xây dựng  và phát triển sổ tay thương hiệu.\n- Xây dựng tính cách của thương hiệu.',549),(2736,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,4,'- Xây dựng chiến lược truyền thông thương hiệu.\n- Đặt tên thương hiệu và Sáng tạo Slogan và thông điệp truyền thông thương hiệu.\n- Phát triển và quản trị các nhãn hiệu và thương hiệu.',549),(2737,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,5,'Khả năng định hướng và hướng dẫn việc lập, thực thi, kiểm soát và đánh giá các chiến lược marketing, truyền thông quảng và các hoạt động khác liên quan đến việc xây dựng thương hiệu trong ngắn hạn và dài hạn',549),(2738,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,1,'- Biết được tầm quan trọng của việc phát triển sản phẩm mới.\n- Liệt kê được các đầu việc quan trọng trong việc phát triển sản phẩm mới.',550),(2739,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,2,'- Hiểu được quy trình thứ tự các bước để phát triển một sản phẩm mới.\n- Thảo luận về những ý tưởng liên quan đến sản phẩm mới.',550),(2740,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,3,'- Đưa ra được các ý tưởng về sản phẩm mới từ việc phân tích thông tin từ khách hàng, nội bộ, đối thủ…. \n- Phối hợp với các bộ phận liên quan để thực hiện công việc phát triển sản phẩm mới theo kế hoạch. ',550),(2741,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,4,'- Thẩm định sàng lọc ý tưởng về phát triển sản phẩm mới.\n- Lập kế hoạch về dự án phát triển sản phẩm mới.',550),(2742,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,5,'- Định hướng phát triển sản phẩm mới.\n- Thẩm định, phệ duyệt và triển khai tổ chức các dự án về phát triển sản phẩm mới.',550),(2743,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,1,' - Định nghĩa được thế nào là giá bán.\n- Biết đước các yếu tố cấu thành nên giá bán của sản phẩm.',551),(2744,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,2,'- Phân biệt được giá thành và giá bán.\n- Phân loại các phân khúc giá của thị trường.\n- Giải thích được quy trình để xác định giá bán của sản phẩm.',551),(2745,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,3,'- Thu thập, phân tích và đánh giá giá bán sản phẩm của từng đối thủ trên thị trường.\n- Vận dụng tính toán đưa ra giá bán sản phẩm phù hợp với từng phân khúc và có khả năng cạnh tranh với giá bán trên thị trường của đối thủ.',551),(2746,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,4,'- Điều tra, khảo sát giá bán trên thị trường.\n- Phân tích, lý giải những điểm chưa phù hợp của giá bán phẩm. Đưa ra đề xuất nhằm cải thiện giá bán mang lại hiệu quả hơn.',551),(2747,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,5,'- Đưa quy trình chuẩn về việc xác định phân khúc giá bán sản phẩm.\n- Đào tạo, hướng dẫn nghiệp vụ liên quan đến việc xác định phân khúc giá bán sản phẩm.',551),(2748,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,1,'- Liệt kê được các loại hình chương trình phổ biến\n- Mô tả được các bước để tổ chức một chương trình.',552),(2749,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,2,'- Làm rõ được quy trình để chức một chương trình.\n- Thảo luận về những ý tưởng để tổ chức chương trình.\n- Tìm kiếm các đơn vị cung cấp dịch vụ tổ chức chương trình phù hợp.',552),(2750,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,3,'- Soạn thảo hợp đồng, thống nhất nội dung chương trình với các đơn vị tổ chức sự kiện bên ngoài.\n- Lên nội dung, kịch bản và lập kế hoạch chi tiết cho việc tổ chức chương trình.\n- Phân công nhân sự, điều phối và tổ chức thực hiện chương trình, sự kiện\n- Kiểm soát việc thực hiện chương trình của nhà cung cấp.',552),(2751,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,4,'- Khảo sát mức độ hài lòng về chương trình.\n- Phân tích đánh giá mức độ hiệu quả của chương trình.\n- Kiểm soát được các rủi ro trong quá trình diễn ra chương trình. Đưa ra được giải pháp khắc phục khi có sự cố.',552),(2752,'2020-03-31 13:22:23',NULL,0,NULL,NULL,0,5,'Khả năng hoạch định chi tiết kế hoạch và đưa ra quy trình, trình tự hướng dẫn giải quyết các công việc trong quá trình tổ chức và các công việc phát sinh.',552);
