INSERT INTO `nangluc` VALUES (106,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Lời nói đi đôi với hành động cụ thể. Kiên quyết bảo vệ lẽ phải, bảo vệ cái đúng, cái tích cực. Nói không với tiêu cực, thẳn thắng nhận khuyết điểm của cá nhân chia sẻ khéo léo và chân thành với đồng nghiệp về khuyết điểm của họ để người Lix tốt hơn mỗi ngày','A001','Trung thực - \"Luôn nói thật, làm thật\"',1),(107,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Trước sau một lòng một dạ, gởi trọn niềm tin, cam kết gắn vó lâu dài vì sự phát triển trường tồn của Công ty. Nhân viên luôn làm việc chăm chỉ và cam kết cho sự thành công của Công ty, luôn nỗ lực hết mình và đặt lợi ích Công ty trên lợi ích cá nhân','A002','Trung thành - \"Luôn gắn bó lâu dài\"',1),(108,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Trong các mối quan hệ làm việc đều đặt trọn niềm tin với nhau. Thể hiện sự tin tưởng với chiến lược phát triển của Công ty. Trong mối quan hệ đồng nghiệp luôn thể hiện sự tin tưởng lẫn nhau. Là đại sứ tạo dựng niềm tin với khách hàng đối tác.','A003','Tin tưởng - \"Luôn xây dựng niềm tin với nhau\"',1),(109,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Tinh thần tôn trọng và Tư duy cởi mở, chấp nhận sự khác biệt; Tinh thần cầu thị, động lực học hỏi và hoàn thiện không ngừng; Văn hóa dân chủ và thực sự bình đẳng; Văn hóa chia sẻ và được chia sẻ; Văn hóa đặt tri thức làm nền tảng.','A004','Tôn trọng - \"Luôn coi trọng và quý mến mọi người\"',1),(110,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Tôi thực hiện công việc với cả cái tâm, với tấm lòng chân thật, thể hiện sự tận tuỵ trong công việc cho dù tôi không thích hay rất thích điều gì liên quan đến công việc ấy.					','A005','Tận tâm: Luôn hành động bằng tất cả tấm lòng ',1),(111,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Là tôn chỉ cao nhất trong hành xử và ra quyết định của bản thân tại mọi vị trí công việc và mọi cấp bậc; Động lực làm việc dựa trên nguyên tắc \"Điều gì đúng\" (Công việc) mà không tập trung vào việc \"Ai đúng\" (Cá nhân); Tinh thần phản biện khách quan, có tính xây dựng và hướng tới giải pháp; Tinh thần tự phản biện mạnh mẽ để khách quan trong nhận định và ra quyết định vì lợi ích chung của Tổ chức.     ','A006','Công bằng với mọi người: Công bằng với nhân viên, khách hàng, nhà cung cấp và các bên liên quan khác.',1),(112,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Quan tâm và hỗ trợ lẫn nhau trong công việc. Cung cấp thông tin hữu ích và khách quan trong các mối quan hệ hợp tác. Phát huy vai trò chia sẻ trách nhiệm với cộng đồng','A007','Chia sẻ : Chia sẽ với đồng nghiệp, đối tác và cộng đồng',1),(113,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Tư duy chiến lược là khả năng xác định được các mục tiêu và ưu tiên quan trọng, từ đó có kế hoạch hành động đảm bảo nhất quán được với lợi ích và giá trị lâu dài của tổ chức.','B001','Tư duy chiến lược ',2),(114,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Kỹ năng quản trị xung đột là khả năng phát hiện, giải quyết, ngăn chặn hoặc tận dụng xung đột','B002','Kỹ năng quản trị xung đột ',2),(115,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Kỹ năng xây dựng và phát triển đội nhóm là khả năng tạo lập nền tảng, dẫn dắt và hỗ trợ một nhóm để đạt được hiệu quả công việc.','B003','Kỹ năng xây dựng và phát triển đội nhóm ',2),(116,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Kỹ năng đào tạo là khả năng truyền đạt kỹ năng, kiến thức cho người khác.','B004','Kỹ năng đào tạo ',2),(117,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Kỹ năng tạo ảnh hưởng là khả năng tạo được uy tín, thuyết phục, nhờ đó nhận được sự hỗ trợ, ủng hộ từ người khác.','B005','Kỹ năng tạo ảnh hưởng',2),(118,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Kỹ năng quản trị rủi ro là khả năng xác định, phân tích, đánh giá và phản ứng trước các rủi ro trong quá trình thực hiện mục tiêu công việc. ','B006','Kỹ năng quản trị rủi ro',2),(119,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Năng lực lãnh đạo là khả năng dẫn dắt tổ chức trong quá trình thực hiện mục tiêu của tổ chức.','B007','Năng lực lãnh đạo',2),(120,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Là kiến thức và kỹ năng lập kế hoạch hoạt động hàng năm cho phòng ban, đơn vị mình phụ trách','B008','Xây dựng kế hoạch hoạt động năm của bộ phận (AOP)',2),(121,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Chia sẻ hoặc chuyển quyền hạn và trách nhiệm liên quan, từ cấp trên cho cấp dưới, giữa người uỷ quyền và người nhận uỷ quyền','B009','Phân quyền, uỷ quyền',2),(122,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Là khả năng xây dựng, kiểm soát và đánh giá ngân sách thường xuyên góp phần giảm thiểu sự chênh lệch giữ lập kế hoạch ngân sách và thực tế.','B010','Quản lý ngân sách',2),(123,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Là năng lực sử dụng tiếng Anh phục vụ cho công việc trong phạm vi trách nhiệm','C001','Anh văn',3),(124,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Là năng lực sử dụng các công cụ MS Office vào công việc','C002','Tin học văn phòng',3),(125,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Kỹ năng giao tiếp là khả năng sử dụng phương tiện ngôn ngữ nói hoặc ngôn ngữ cơ thể để diễn đạt suy nghĩ, ý kiến, cảm nhận một cách rõ ràng và thuyết phục; đồng thời thúc đẩy được giao tiếp hai chiều.','C003','Kỹ năng giao tiếp',3),(126,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Kỹ năng đàm phán - thuyết phục là khả năng đưa ra phương án thống nhất trong tình huống mâu thuẫn, giảm thiểu xung đột lợi ích giữa các bên để đạt được kết quả tốt nhất và giữ vững mối quan hệ hợp tác.','C004','Kỹ năng đàm phán, thuyết phục',3),(127,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Kỹ năng làm việc nhóm là khả năng thiết lập và duy trì mối quan hệ hợp tác tích cực với các thành viên khác để hoàn thành tốt đẹp các mục tiêu chung.','C005','Kỹ năng làm việc nhóm',3),(128,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Kỹ năng phân tích, xử lí tình huống và ra quyết định là khả năng phát hiện ra vấn đề, phân tích và liên hệ các thông tin để thấu hiểu toàn diện vấn đề; đồng thời đưa ra được các phương án, đánh giá được các phương án và quyết định được hướng giải quyết.','C006','Kỹ năng phân tích, xử lí tình huống và ra quyết định',3),(129,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Năng lực sáng tạo và đổi mới là khả năng thách thức các tư duy truyền thống và nhìn nhận tình huống dưới góc độ mới, đưa ra các cách làm mới, xây dựng các sản phẩm và quy trình mới.','C007','Năng lực sáng tạo và đổi mới',3),(130,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Là khả năng trình bày văn bản đúng thể thức và kỹ thuật của loại văn bản được yêu cầu soạn thảo.','C008','Kỹ năng soạn thảo văn bản hành chánh',3),(131,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Kỹ năng xây dựng mạng lưới quan hệ công việc (networking) là khả năng xây dựng và chủ động duy trì các mối quan hệ cộng tác công việc nhằm phục vụ cho hoàn thành mục tiêu công việc tương lai.','C009','Kỹ năng xây dựng mạng lưới quan hệ công việc (networking)',3),(132,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Kỹ năng tổ chức và quản lý thời gian là khả năng sắp xếp và sử dụng một cách có hiệu quả nguồn lực và thời gian giới hạn để đảm bảo hoàn thành công việc.','C010','Kỹ năng tổ chức và quản lý thời gian',3),(133,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Tư duy tập trung vào kết quả là tư duy tạo ra kết quả kinh doanh dựa trên yêu cầu nhất quán; thiết lập và đạt được mục tiêu; luôn tuân thủ các tiêu chuẩn về chất lượng, dịch vụ, năng suất và đáp ứng thời hạn; duy trì tập trung vào mục tiêu của tổ chức.','C011','Tư duy tập trung vào kết quả',3),(134,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Bền bỉ, kiên trì là thái độ nỗ lực, cố gắng không ngừng nghỉ, quyết tâm vượt qua thử thách để theo đuổi mục đích mà mình đã đề ra.','C012','Thái độ kiên trì, bền bỉ',3),(135,'2020-01-17 20:32:28',NULL,0,NULL,NULL,0,NULL,'Hoàn thành công việc trong phạm vi mà không cần đến sự thúc giục','C013','Chủ động trong công việc',3),(136,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng hiểu biết và thực hiện hạch toán các nghiệp vụ kế toán','D001','Năng lực hạch toán',4),(137,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng lập và trình bày BCTC đúng quy định','D002','Năng lực lập và trình bày BCTC',4),(138,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng hiểu biết và thực hiện về các văn bản quy phạm pháp luật liên quan đến phát luật lao động','D003','Năng lực về pháp luật lao động và bảo hiểm.',4),(139,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng hiểu biết và thực hiện về các văn bản quy phạm pháp luật liên quan đến phát luật công ty, bao gồm Luật DN, Luật TM, Luật DS, Luật đấu thầu.','D004','Năng lực về luật công ty (Luật thương mại, Luật dân sự, Luật đấu thầu, luật doanh nghiệp…)',4),(140,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Khả năng hiểu biết và vận dụng các chính sách thuế GTGT','D005','Thuế GTGT',4),(141,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Khả năng hiểu biết và vận dụng các chính sách thuế TNDN','D006','Thuế TNDN',4),(142,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Khả năng hiểu biết và vận dụng các chính sách thuế TNCN','D007','Thuế TNCN',4),(143,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Khả năng hiểu biết và vận dụng các chính sách thuế không phổ biến trong trường hợp có phát sinh','D008','Các loại thuế khác (Thuế môn bài, Thuế Nhà thầu,…)',4),(144,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng phân tích các chỉ số tổng quát về tình hình tài chính. Các chỉ số tài chính tổng quát bao gồm: Hệ số tự tài trợ, Hệ số tự tài trợ tài sản dài hạn, Hệ số đầu tư dài hạn, Hệ số khả năng thanh toán tổng quát, hệ số thanh toán nợ ngắn hạn, ROA. ROE','D009','Năng lực phân tích khái quát tình hình tài chính Doanh nghiệp',4),(145,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng phân tích các chỉ số liên quan đến công nợ và khả năng thanh toán, bao gồm: Nợ phải thu so với nợ phải trả, Hệ số Nợ phải thu, Hệ số Nợ phải trả, Vòng quay khoản phải thu, Vòng quay khoản phải trả, Hệ số khả năng thanh toán nhanh, Hệ số khả năng thanh toán lãi vay ','D010','Năng lực phân tích công nợ và khả năng thanh toán của Doanh nghiệp',4),(146,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng phân tích các chỉ tiêu đánh giá hiệu quả sử dụng vốn, gồm ROA và ROE','D011','Năng lực phân tích các chỉ tiêu khả năng sử dụng vốn của Doanh nghiệp',4),(147,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng hiểu biết về các hoạt động chính của công ty, bao gồm cả hoạt động sản sản xuất kinh doanh','D012','Hiểu biết về hoạt động của Công ty',4),(148,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng quản trị các rủi ro về nợ xấu, tỉ giá hối đoái, cổ phiếu, lãi suất biến động…','D013','Năng lực về quản trị rủi ro tài chính',4),(149,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng quản trị các rủi ro về trang thiết bị, hệ thống máy tính, chuỗi cung ứng, quy trình hoạt động, nhân lực…','D014','Năng lực về quản trị rủi ro tác nghiệp (rủi ro hoạt động)',4),(150,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng xây dựng kế hoạch kiểm toán năm, kế hoạch kiểm toán cho từng cuộc kiểm toán','D015','Lập kế hoạch kiểm toán',4),(151,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng thiết lập được các thủ tục kiểm toán để kiểm tra các khoản mục trên BCTC','D016','Xây dựng chương trình kiểm toán BCTC',4),(152,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng thiết lập được các thủ tục kiểm toán để kiểm tra sự tuân thủ','D017','Xây dựng chương trình kiểm toán tuân thủ',4),(153,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng thiết lập được các thủ tục kiểm toán hoạt động','D018','Xây dựng chương trình kiểm toán hoạt động',4),(154,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng thực hiện các chương trình kiểm toán BCTC','D019','Thực hiện các phần hành kiểm toán BCTC',4),(155,'2020-02-04 10:33:45',NULL,0,NULL,NULL,0,'30009','Là khả năng thực 