uản lý thực hiện công việc vào việc hoạch định, theo dõi, đánh giá, khen thưởng và tăng cường hiệu suất của nhân viên. Bảo đảm hệ thống đánh giá KPI đạt mục tiêu của công ty.','D014','Quản trị hệ thống KPI',4),(392,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Thiết kế, phát triển hệ thống và quy định đánh giá năng lực. Thực hiện công việc theo dõi, đánh giá, khen thưởng và nâng cao năng lực của nhân viên. Bảo đảm hệ thống đánh giá đạt mục tiêu quản lý năng lực của công ty.','D015','Quản trị hệ thống đánh giá năng lực',4),(393,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Thiết kế, phát triển hệ thống và quy định quản trị nhóm nhân tài nhằm thu hút, phát hiện, giữ và phát huy những cá nhân xuất sắc có tiềm năng vượt trội để duy trì những nhân viên tuyệt của công ty cũng như quy hoạch cán bộ nguồn.','D016','Quản trị nhóm nhân viên tài năng',4),(394,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Thiết kế, phát triển và thực hiện các chương trình lương thưởng, phúc lợi để thu hút, duy trì nhân viên giỏi, động viên khích lệ nhân viên làm việc hiệu quả','D017','Quản lý lương, thưởng, phúc lợi',4),(395,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Kiến thức về luật, điều lệ, quy định, nguyên tắc và thông lệ liên quan đạo đức nghề nghiệp, kết quả làm việc và giải quyết tranh chấp của nhân viên, cũng như thương thuyết và thực hiện thỏa thuận lao động, hưu trí, bảo hiểm và các chính sách chế độ  khác','D018','Quan hệ lao động',4),(396,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Hiểu biết về pháp luật liên quan đến các lĩnh vực quản trị nhân sự bao gồm nhưng không giới hạn bởi Luật Lao động, BHXH, BHYT, BH thất nghiệp và các văn bản pháp quy liên quan khác. Khả năng xây dựng và đề xuất điều chỉnh quy chế, quy định, nội quy liên quan tới lĩnh vực quản trị nhân sự','D019','Am hiểu pháp luật liên quan tới công tác quản trị nhân sự',4),(397,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Cập nhật, lưu trữ, truy xuất và tổng hợp thông tin nhân sự','D020','Quản lý thông tin nhân sự',4),(398,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Khả năng tính chính xác thuế thu nhập cá nhân của người lao động theo luật định và lập báo cáo liên quan','D021','Tính Thuế thu nhập cá nhân',4),(399,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Khả năng thiết lập các chỉ tiêu báo cáo liên quan đến chức năng, nhiệm vụ được phân công một cách đầy đủ và chính xác. Các báo cáo định kỳ hoặc đột xuất phải thực hiện theo yêu cầu của công việc.','D022','Báo cáo nhân sự',4),(400,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','\nKhả năng thực hiện các chính sách chế độ cho người lao động liên quan đến bảo hiểm bao gồm: BHXH, BHTN, BHTN, BHYT','D023','Bảo hiểm',4),(401,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Ghi nhận thời gian làm việc của người lao động đúng với thực tế theo qui định cty.','D024','Chấm công',4),(402,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Tính đúng, đủ thu nhập của công nhân căn cứ theo chấm công thực tế, chính sách của cty và luật hiện hành liên quan','D025','Tính lương công nhân',4),(403,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Là khả năng hiểu biết hệ thống trả lương theo chức danh, thực hiện tính toán chi trả lương cho CBCNV khối gián tiếp đảm bảo đúng theo quy định và chính sách trả lương theo chức danh','D026','Tính lương khối gián tiếp',4),(404,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Là khả năng trình bày văn bản đúng thể thức và kỹ thuật của loại văn bản được yêu cầu soạn thảo.','D027','Soạn thảo văn bản hành chính',4),(405,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Là khả năng trình bày các nội dung cơ bản của hợp đồng.','D028','Soạn thảo hợp đồng',4),(406,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Là khả năng trình bày các nguyên tắc tổ chức, hoạt động của Công ty.','D029','Soạn thảo các quy định nội bộ của Công ty',4),(407,'2020-02-06 10:56:29',NULL,0,NULL,NULL,0,'30025','Là khả năng đọc hiểu, sàng lọc các quy định pháp luật mới ban hành liên quan đến tổ ch